    t[192] = "SAM (Simple Anonymous Messaging) is a protocol which allows a client application written in any programming language to communicate over I2P, by using a socket-based interface to the I2P router. For more information, see the <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[193] = "SAM (Basit Anonim Mesajla\u015fma), herhangi bir programlama dilinde yaz\u0131lm\u0131\u015f bir istemci uygulamas\u0131n\u0131n I2P \u00fczerinde ileti\u015fim kurmas\u0131na olanak sa\u011flayan bir protokold\u00fcr. Bu, I2P y\u00f6nlendiricisiyle soket tabanl\u0131 bir ara y\u00fcz kullanarak ger\u00e7ekle\u015ftirilir. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/api/samv3 class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelere</a> bak\u0131n.";
