    t[234] = "Note: Your contribution to the network (network share) is determined by the allocation of upstream bandwidth (upload speed).";
    t[235] = "Not: A\u011fa katk\u0131n\u0131z (a\u011f payla\u015f\u0131m\u0131), yukar\u0131 ak\u0131\u015f bant geni\u015fli\u011finin (y\u00fckleme h\u0131z\u0131) tahsisine g\u00f6re belirlenir.";
    t[236] = "Advanced Router Configuration";
    t[237] = "Geli\u015fmi\u015f Y\u00f6nlendirici Yap\u0131land\u0131rmas\u0131";
    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "T\u00fcnellerin olu\u015fturulmas\u0131 i\u00e7in i\u015flemci i\u015f par\u00e7ac\u0131\u011f\u0131 say\u0131s\u0131n\u0131 ay\u0131r\u0131n. \u0130\u015flemciniz hiper\u00e7oklu i\u015flem veya e\u015fzamanl\u0131 \u00e7oklu i\u015f par\u00e7ac\u0131\u011f\u0131 destekliyorsa, i\u015flemci \u00e7ekirdeklerinin say\u0131s\u0131n\u0131 2 ile \u00e7arparak tahsis edilecek maksimum i\u015f par\u00e7ac\u0131\u011f\u0131 say\u0131s\u0131n\u0131 alabilirsiniz; aksi halde i\u015flemci \u00e7ekirdek say\u0131s\u0131 = tahsis edilebilir maksimum i\u015f par\u00e7ac\u0131\u011f\u0131 say\u0131s\u0131. Teorik maksimumdan daha az tahsis etmek isteyebilece\u011finizi unutmay\u0131n, b\u00f6ylece ba\u015fka g\u00f6revler i\u00e7in yer a\u00e7m\u0131\u015f olursunuz.";
