    t[286] = "Note that there can only be a single reference to the <i class=example>default</i> keyword in a filter file. If unstated, all connections are permitted unless explicitly forbidden. Errors in the filter file will prevent a stopped tunnel from starting, so be sure to double check the syntax before deployment.";
    t[287] = "Bir filtre dosyas\u0131nda yaln\u0131zca <i class=example>default</i> anahtar kelimesine bir referans olabilir. Belirtilmezse, t\u00fcm ba\u011flant\u0131lara izin verilir, ancak a\u00e7\u0131k\u00e7a yasaklanmad\u0131k\u00e7a. Filtre dosyas\u0131ndaki hatalar durdurulan bir t\u00fcnelin ba\u015flamas\u0131n\u0131 engeller, bu nedenle da\u011f\u0131t\u0131mdan \u00f6nce s\u00f6zdizimini \u00e7ift kontrol edin.";
