    t[353] = "IP Adresi";
    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Yeni bir hizmet t\u00fcneli olu\u015fturuldu\u011funda veya bir hizmet ilk kez \u00e7al\u0131\u015ft\u0131r\u0131ld\u0131\u011f\u0131nda (\u00f6rne\u011fin, varsay\u0131lan jetty web sunucusu, eklentiler) temel olarak adresin sahipli\u011fini kontrol eden \u00f6zel bir \u015fifreleme anahtar\u0131 olu\u015fturulur. Bu genellikle <code>&hellip;privKey.dat</code> veya <code>eepPriv.dat</code> olarak adland\u0131r\u0131l\u0131r, ancak ismi hizmete ait oldu\u011funu belirtmek ve ard\u0131ndan onu T\u00fcnel Y\u00f6neticisi sunucu ayarlar\u0131nda yeniden belirtmek iyi bir fikirdir. Bu .dat dosyas\u0131n\u0131 g\u00fcvenli bir \u015fekilde yedeklemelisiniz; kaybederseniz, sahiplik ve ana makine ad\u0131n\u0131z\u0131n kontrol\u00fcn\u00fc kaybedersiniz!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Bu ayar, bir torrent indirildi\u011finde veya olu\u015fturuldu\u011funda I2PSnark'\u0131n izin verece\u011fi maksimum dosya say\u0131s\u0131n\u0131n yap\u0131land\u0131r\u0131lmas\u0131na izin verir. Bu de\u011feri varsay\u0131lan 2000 dosyan\u0131n \u00fczerine \u00f6nemli \u00f6l\u00e7\u00fcde art\u0131rmak, i\u015fletim sisteminin izin verece\u011fi maksimum a\u00e7\u0131k dosya say\u0131s\u0131n\u0131 art\u0131rmak i\u00e7in ek yap\u0131land\u0131rmalar\u0131n gerekebilece\u011fi anlam\u0131na gelir (\u00f6rne\u011fin Linux'ta <code>ulimit -n</code>). De\u011fi\u015ftirmek i\u00e7in, I2PSnark'\u0131n yap\u0131land\u0131rma dosyas\u0131na <code>i2psnark.config</code> ekleyin. [I2PSnark veya y\u00f6nlendiricinin yeniden ba\u015flat\u0131lmas\u0131 gerekmektedir]";
    t[370] = "Configure router bandwidth allocation";
    t[371] = "Y\u00f6neltici bant geni\u015fli\u011fi kullan\u0131m\u0131n\u0131 yap\u0131land\u0131r\u0131n";
    t[372] = "Here are some other public addressbook subscription links. You may wish to add one or two to your <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns subscription list</a>. In the event that addresses conflict in the subscriptions, the lists placed at the top of your susidns configuration will take precedence over those placed further down.";
    t[373] = "\u0130\u015fte di\u011fer baz\u0131 halka a\u00e7\u0131k adres defteri abonelik ba\u011flant\u0131lar\u0131. <a href='/dns?subscriptions' target=_blank rel=noreferrer>Susidns abonelik listesine</a> bir ya da iki tanesini eklemek isteyebilirsiniz. Aboneliklerde adresler \u00e7ak\u0131\u015f\u0131rsa, susidns yap\u0131land\u0131rman\u0131n \u00fcst k\u0131sm\u0131na yerle\u015ftirilen listeler, daha a\u015fa\u011f\u0131da yer alanlardan \u00f6ncelik al\u0131r.";
