    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "Bonuslar pozitif veya negatif olabilir ve akran\u0131n h\u0131zl\u0131 ve y\u00fcksek kapasiteli katmanlara dahil edilmesini etkiler. H\u0131zl\u0131 akranlar m\u00fc\u015fteri t\u00fcnelleri i\u00e7in kullan\u0131l\u0131r ve baz\u0131 ke\u015fif t\u00fcnelleri i\u00e7in y\u00fcksek kapasiteli akranlar kullan\u0131l\u0131r.";
    t[618] = "Yes";
    t[619] = "Evet";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "I2P bu yap\u0131land\u0131rma ile sorunsuz \u00e7al\u0131\u015f\u0131r ancak ger\u00e7ekten payla\u015f\u0131m i\u00e7in bant geni\u015fli\u011finiz 128KBps \u00fczerinde ise, a\u011f\u0131 \u00e7ok daha fazla g\u00fc\u00e7lendirmek i\u00e7in g\u00fcvenlik duvar\u0131n\u0131 a\u00e7mal\u0131s\u0131n\u0131z.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "I2P ile birlikte verilen komut sat\u0131r\u0131 uygulamas\u0131d\u0131r ve URL kaynaklar\u0131n\u0131n istenmesi i\u00e7in kullan\u0131l\u0131r, <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> veya <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a> gibi. Eepget ayr\u0131ca, \u00f6rne\u011fin uzaktaki sunuculardan yeniden eklenmek i\u00e7in, rota taraf\u0131ndan dahili olarak da kullan\u0131l\u0131r. Varsay\u0131lan olarak, eepget <code>127.0.0.1:4444</code> \u00fczerindeki HTTP proxy'sini kullan\u0131r.";
