    t[722] = "Javadocs";
    t[723] = "Javadoc'lar";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Bir eepsite, I2P a\u011f\u0131ndaki gizli olarak bar\u0131nd\u0131r\u0131lan bir web sitesidir - ona I2P'nin HTTP proxy'sini kullanacak \u015fekilde web taray\u0131c\u0131n\u0131z\u0131 yap\u0131land\u0131rarak eri\u015febilirsiniz (yukar\u0131ya bak\u0131n) ve <code>.i2p</code> ekli web sitesine (\u00f6rn. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>) g\u00f6z atabilirsiniz. Ayr\u0131ca, proxyyi kullan\u0131rken DNS s\u0131z\u0131nt\u0131lar\u0131n\u0131 \u00f6nlemek i\u00e7in taray\u0131c\u0131n\u0131z\u0131n uzaktan DNS \u00e7\u00f6z\u00fcmlemesi i\u00e7in yap\u0131land\u0131r\u0131ld\u0131\u011f\u0131ndan emin olun.";
