    t[771] = "D\u00fcnya Atlas\u0131";
    t[772] = "If you can't, I2P supports UPnP (Universal Plug and Play) and UDP hole punching with \"SSU introductions\" to relay traffic.";
    t[773] = "Bu i\u015flemi yapam\u0131yorsan\u0131z I2P, UPnP (Universal plug and Play) ve \"SSU rehberleri\" ile UDP delik a\u00e7ma \u00f6zelliklerini kullanarak trafi\u011fi aktar\u0131r.";
