    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "\u0130lk say\u0131, y\u00f6nlendiricinizin son birka\u00e7 dakikada bir ileti g\u00f6nderdi\u011fi veya al\u0131p ald\u0131\u011f\u0131 e\u015f say\u0131s\u0131d\u0131r. Bu, toplam bant geni\u015fli\u011finize, payla\u015f\u0131lan bant geni\u015fli\u011finize ve yerel olarak olu\u015fturulan trafi\u011fe ba\u011fl\u0131 olarak 8-10'dan y\u00fczlerce say\u0131ya kadar de\u011fi\u015febilir. \u0130kinci say\u0131, son bir saatte g\u00f6r\u00fclen e\u015f say\u0131s\u0131d\u0131r. Bu say\u0131lar\u0131n geni\u015f bir aral\u0131kta de\u011fi\u015fmesiyle ilgilenmeyin. <a href='/configstats#router.activePeers'>[Grafiklemeyi etkinle\u015ftir]</a>.";
