    t[878] = "This setting permits disabling SSU tests to determine if your router is firewalled and can be enabled for routers that are definitely not firewalled but are experiencing intermittent firewalling issues. In the event that testing is disabled, both SSU and NTCP should report your current public ip address on <a href=/info>the router info page</a>. [Restart required]";
    t[879] = "Bu ayar, y\u00f6nlendiricinizin g\u00fcvenlik duvar\u0131 ile korunup korunmad\u0131\u011f\u0131n\u0131 belirlemek i\u00e7in SSU testlerinin devre d\u0131\u015f\u0131 b\u0131rak\u0131lmas\u0131na izin verir ve kesinlikle g\u00fcvenlik duvar\u0131 ile korunmayan ancak aral\u0131kl\u0131 g\u00fcvenlik duvar\u0131 sorunlar\u0131 ya\u015fayan y\u00f6nlendiriciler i\u00e7in etkinle\u015ftirilebilir. Testin devre d\u0131\u015f\u0131 b\u0131rak\u0131lmas\u0131 durumunda hem SSU hem de NTCP, mevcut genel IP adresinizi <a href=/info>y\u00f6nlendirici bilgi sayfas\u0131nda</a> bildirmelidir. [Yeniden ba\u015flatma gerekiyor]";
