    t[977] = "D\u0131\u015far\u0131dan ula\u015f\u0131labilir sunucu ad\u0131 ya da IP adresi";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Web sunucunuz varsay\u0131lan olarak <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a> adresinde \u00e7al\u0131\u015f\u0131yor, ancak <i>I2P Web Sunucusu</i> t\u00fcnelini ba\u015flatana kadar ba\u015fkalar\u0131 taraf\u0131ndan eri\u015filemez. T\u00fcneli ba\u015flatt\u0131ktan sonra, siteniz ba\u015fkalar\u0131 i\u00e7in zor bulunur hale gelecektir. \u0130nsanlara hedefi veya Base32 adresi s\u00f6yleyebilirsiniz, ancak neyse ki I2P'nin alan adlar\u0131n\u0131 depolayan bir adres defteri ve \u00fccretsiz bir \u015fekilde yeni bir .i2p alan ad\u0131 <a href=/help/hostnameregistration>kaydedebilece\u011finiz</a> \u00e7e\u015fitli hizmetler bulunmaktad\u0131r.";
