    t[1062] = "When set to true, accessing the router console via http:// when https:// is enabled will automatically redirect to https. To configure router console access, edit the settings in your <code>clients.config</code> file in your profile directory (<i>not</i> the application installation directory). [Enabled by default]";
    t[1063] = "True olarak ayarland\u0131\u011f\u0131nda, https:// etkin oldu\u011funda http:// \u00fczerinden y\u00f6nlendirici konsoluna eri\u015fim otomatik olarak https://'ye y\u00f6nlendirilir. Y\u00f6nlendirici konsol eri\u015fimini yap\u0131land\u0131rmak i\u00e7in, profil dizininizdeki <code>clients.config</code> dosyas\u0131ndaki ayarlar\u0131 d\u00fczenleyin (<i>uygulama kurulum dizini</i> de\u011fil). [Varsay\u0131lan olarak etkin]";
