    t[1170] = "News last updated {0} ago.";
    t[1171] = "Haberler en son {0} \u00f6nce g\u00fcncellendi.";
    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "Ba\u011flanmak istedi\u011finiz servis i\u00e7in bir d\u0131\u015f proxy kurulmad\u0131\u011f\u0131 s\u00fcrece, BitTorrent hari\u00e7, bu m\u00fcmk\u00fcn de\u011fildir (a\u015fa\u011f\u0131ya bak\u0131n). \u015eu anda sadece \u00fc\u00e7 t\u00fcr d\u0131\u015f proxy \u00e7al\u0131\u015f\u0131yor: HTTP, HTTPS ve e-posta. \u015eu anda herhangi bir SOCKS d\u0131\u015f proxy'si yay\u0131nlanmamaktad\u0131r. Bu t\u00fcr bir hizmet gerekiyorsa, <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>'u deneyin.";
