    t[1202] = "Upload Speed";
    t[1203] = "Y\u00fckleme H\u0131z\u0131";
    t[1206] = "config service";
    t[1207] = "hizmet yap\u0131land\u0131rmas\u0131";
    t[1208] = "Watching Big Tech...";
    t[1209] = "Big Tech'i izliyorum...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Bilgisayar\u0131n\u0131z\u0131n saatini, a\u011f senkronize zaman\u0131na g\u00f6re hizalama fark\u0131 (offset). I2P, bilgisayar\u0131n\u0131z\u0131n saatinin do\u011fru olmas\u0131n\u0131 gerektirir. E\u011fer hizalama birka\u00e7 saniyeden fazlaysa, l\u00fctfen bilgisayar\u0131n\u0131z\u0131n saatini ayarlayarak probleminizi d\u00fczeltin. E\u011fer I2P internete ba\u011flanam\u0131yorsa, 0ms okumas\u0131 yap\u0131labilir. Not: Bu sadece <i>Y\u00f6nlendirici Bilgisi (geli\u015fmi\u015f)</i> b\u00f6l\u00fcm\u00fcnde g\u00f6r\u00fcnt\u00fclenir. Bu b\u00f6l\u00fcm\u00fc kenar \u00e7ubu\u011funuza <a href='/configsidebar'>Kenar \u00c7ubu\u011fu Yap\u0131land\u0131rma sayfas\u0131</a> \u00fczerinden ekleyebilirsiniz.";
    t[1224] = "Sort by inbound rate";
    t[1225] = "Geli\u015f h\u0131z\u0131na g\u00f6re s\u0131rala";
    t[1236] = "Can I download torrents from non-I2P trackers?";
    t[1237] = "I2P d\u0131\u015f\u0131 izleyicilerden torrent indirebilir miyim?";
    t[1250] = "No update URL specified for {0}";
    t[1251] = "{0} i\u00e7in bir g\u00fcncelleme adresi belirtilmemi\u015f";
    t[1252] = "Under <i>Select zip or su3 file</i> click <i>Browse&hellip;</i>";
