    t[1262] = "Filter Router log output";
    t[1263] = "Router g\u00fcnl\u00fck \u00e7\u0131kt\u0131s\u0131n\u0131 filtrele";
    t[1268] = "Anonymous webmail client";
    t[1269] = "Anonimlik sa\u011flayan web posta istemcisi";
    t[1272] = "To migrate the key to a new router, or to setup multihoming (running the same service on multiple routers for redundancy and load-balancing), copy the backed up key to your .i2p directory and specify it in the new server tunnel, or replace the default key in the plugin folder (e.g. the zzzot plugin).";
    t[1273] = "Anahtar\u0131n\u0131z\u0131 yeni bir y\u00f6nlendiriciye ta\u015f\u0131mak veya \u00e7oklama kurmak (ayn\u0131 hizmeti yedekleme ve y\u00fck dengeleme i\u00e7in birden \u00e7ok y\u00f6nlendiricide \u00e7al\u0131\u015ft\u0131rma) i\u00e7in, yedeklenmi\u015f anahtar\u0131n\u0131z\u0131 .i2p dizininize kopyalay\u0131n ve yeni sunucu t\u00fcnelinde belirtin veya eklenti klas\u00f6r\u00fcndeki varsay\u0131lan anahtar\u0131 de\u011fi\u015ftirin (\u00f6rne\u011fin, zzzot eklentisi).";
    t[1276] = "Configuration";
    t[1277] = "Yap\u0131land\u0131rma";
    t[1284] = "Enabled I2P+ service autostart at system startup";
    t[1285] = "Sistem ba\u015flang\u0131c\u0131nda I2P hizmetinin otomatik ba\u015flat\u0131lmas\u0131 etkinle\u015ftirildi";
    t[1294] = "No plugin URL specified.";
    t[1295] = "Uygulama ekinin adresi belirtilmemi\u015f.";
    t[1296] = "Show the router's workload, and how it's performing";
