    t[1299] = "Bu ayar, blok listeleri arac\u0131l\u0131\u011f\u0131yla uygulanan yasaklara yap\u0131land\u0131r\u0131lm\u0131\u015f bir s\u00fcre son kullanma s\u00fcresi (saniye cinsinden) izin verir. Varsay\u0131lan olarak, yasaklar y\u00f6nlendirici oturumunun s\u00fcresi boyunca devam eder. [Yeniden ba\u015flatma gereklidir]";
    t[1310] = "Total peers in NetDb";
