    t[1325] = "I2CP";
    t[1326] = "This mode enhances anonymity by preventing correlation between public IP address changes and your router identity. Both your router identity and UDP port will be changed.";
    t[1327] = "Bu mod, genel IP adresi de\u011fi\u015fiklikleri ile y\u00f6nlendirici kimli\u011finiz aras\u0131ndaki korelasyonu \u00f6nleyerek anonimli\u011fi art\u0131r\u0131r. Hem y\u00f6nlendirici kimli\u011finiz hem de UDP ba\u011flant\u0131 noktan\u0131z de\u011fi\u015ftirilecektir.";
