    t[1332] = "Graceful restart requested";
    t[1333] = "Uygun \u015fekilde yeniden ba\u015flatma istendi";
    t[1342] = "susidns";
    t[1343] = "susidns";
    t[1350] = "If I2P appears to be using too much ram, you can force the router to run the garbage collection routine to free up memory.";
    t[1351] = "I2P \u00e7ok fazla ram kullan\u0131yor gibi g\u00f6r\u00fcn\u00fcyorsa, y\u00f6nlendiriciyi haf\u0131zada yer a\u00e7mak i\u00e7in \u00e7\u00f6p toplama rutinini \u00e7al\u0131\u015ft\u0131rmaya zorlayabilirsiniz.";
