    t[2013] = "\u015eimdiye kadar olu\u015fturulmu\u015f t\u00fcm eepsiteleri d\u00fc\u015f\u00fcn\u00fcrseniz, evet, \u00e7o\u011fu \u00e7al\u0131\u015fm\u0131yor. \u0130nsanlar ve eepsiteler gelip gider. I2P'ye ba\u015flamak i\u00e7in, \u015fu anda \u00e7al\u0131\u015fan eepsitelerinin listesine g\u00f6z atman\u0131z iyi bir y\u00f6ntemdir. <a href=http://notbob.i2p/ target=_blank rel=noreferrer class=sitelink>http://notbob.i2p</a>, aktif eepsiteleri takip eder.";
