    t[2107] = "Gizli Modda \u00e7al\u0131\u015facak \u015fekilde yap\u0131land\u0131r\u0131lm\u0131\u015f bir y\u00f6nlendirici, detaylar\u0131n\u0131 <i>A\u011f Veritaban\u0131'na</i> yay\u0131nlamaz ve di\u011fer y\u00f6nlendiriciler i\u00e7in trafik y\u00f6nlendirmesine kat\u0131lmaz. Kat\u0131 olarak belirlenen \u00fclkelerde faaliyet g\u00f6steren ve manuel olarak yap\u0131land\u0131r\u0131lan y\u00f6nlendiriciler Gizli Modda \u00e7al\u0131\u015f\u0131r.";
