    t[2184] = "Help with reseeding";
    t[2185] = "Yeniden tohumlama konusunda yard\u0131m";
    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "A\u015fa\u011f\u0131daki e\u015fik tan\u0131m\u0131 <i class=example>180/60</i>, ayn\u0131 uzak hedefin 60 saniye i\u00e7inde 179 ba\u011flant\u0131 denemesi yapmas\u0131na izin verildi\u011fini belirtir. Ayn\u0131 d\u00f6nemde bir kez daha deneme yaparsa, e\u015fik a\u015f\u0131lacak ve d\u00f6nemin sonuna kadar ek ba\u011flant\u0131 denemeleri reddedilecektir:";
    t[2190] = "config home";
    t[2191] = "a\u00e7\u0131l\u0131\u015f sayfas\u0131 yap\u0131land\u0131rmas\u0131";
    t[2192] = "Restore defaults";
    t[2193] = "Varsay\u0131lanlar\u0131 geri y\u00fckle";
    t[2196] = "Abridged I2P FAQ";
    t[2197] = "K\u0131salt\u0131lm\u0131\u015f I2P SSS";
    t[2206] = "Version";
    t[2207] = "S\u00fcr\u00fcm";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P, program ilk \u00e7al\u0131\u015ft\u0131r\u0131ld\u0131\u011f\u0131nda veya <a href=/confignet#ipchange>Laptop Modu</a>'nda \u00e7al\u0131\u015f\u0131rken harici IP adresiniz de\u011fi\u015fti\u011finde, di\u011fer y\u00f6nlendiricilerle ileti\u015fim kurmak i\u00e7in 9000 ila 31000 aras\u0131nda rastgele bir port se\u00e7er. Se\u00e7ilen port, <a href=/confignet>A\u011f Yap\u0131land\u0131rma sayfas\u0131nda</a> g\u00f6sterilir.";
    t[2212] = "Message send rate (B/s)";
    t[2213] = "Mesaj g\u00f6nderme h\u0131z\u0131 (B/s)";
    t[2214] = "Update or check already in progress";
    t[2215] = "G\u00fcncelleme ya da denetim s\u00fcr\u00fcyor";
    t[2218] = "Log date format";
    t[2219] = "G\u00fcnl\u00fck kayd\u0131 tarih bi\u00e7imi";
    t[2226] = "Less than 256MB allocated to the JVM";
    t[2227] = "JVM'ye ayr\u0131lan 256MB'dan az";
    t[2230] = "Average closest floodfill distance";
    t[2231] = "Ortalama en yak\u0131n ta\u015fk\u0131n dolgu mesafesi";
    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Y\u00f6nl\u00fcn\u00fcz\u00fcn ba\u015flamas\u0131ndan itibaren kat\u0131lan t\u00fcnellerin olu\u015fturulmas\u0131n\u0131 kabul etmesi en az 10 dakika s\u00fcrecektir, b\u00f6ylece y\u00f6nl\u00fcn\u00fcz\u00fcn kararl\u0131 oldu\u011fu ve a\u011fa ba\u015far\u0131yla \u00f6ny\u00fcklendi\u011fi sa\u011flan\u0131r.";
    t[2234] = "Last Heard From";
    t[2235] = "Son Duyulan";
    t[2236] = "midnight";
    t[2237] = "gece yar\u0131s\u0131";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "I2P'ye nazik bir giri\u015f";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "\u0130\u015flerin y\u00fcr\u00fct\u00fcmeden \u00f6nce bekledi\u011fi s\u00fcre. \u0130\u015f s\u0131ras\u0131 <a href='/jobs'>\u0130\u015fler sayfas\u0131nda</a> listelenir. Ne yaz\u0131k ki, y\u00f6nl\u00fcde ba\u015fka t\u0131kanm\u0131\u015f i\u015f s\u0131ralar\u0131 da bulunur ve durumlar\u0131 y\u00f6nl\u00fc konsolda mevcut de\u011fildir. \u0130\u015f gecikmesi genellikle s\u0131f\u0131r olmal\u0131d\u0131r. E\u011fer s\u00fcrekli olarak 500ms'den y\u00fcksekse, bilgisayar\u0131n\u0131z \u00e7ok yava\u015f, a\u011f\u0131n\u0131z ba\u011flant\u0131 sorunlar\u0131 ya\u015f\u0131yor veya y\u00f6nl\u00fcn\u00fcz ciddi sorunlar ya\u015f\u0131yor olabilir. <a href='/configstats#jobQueue.jobLag'>[Grafiklemeyi etkinle\u015ftir]</a>";
    t[2252] = "Configure I2P Updates";
    t[2253] = "I2P G\u00fcncelleme Yap\u0131land\u0131rmas\u0131";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Yeni web sitenizi d\u00fcnyaya duyurmadan \u00f6nce, baz\u0131 i\u00e7erikler eklemeniz gerekmektedir. Sunucunun k\u00f6k dizinine gidin ve <a href=#rootdir>yukar\u0131da listelenen</a> <i>index.html</i> y\u00f6nlendirme sayfas\u0131n\u0131 kendi i\u00e7eri\u011finizle de\u011fi\u015ftirin. Basit bir site i\u00e7in bir \u015fablon gerekiyorsa, <a href=http://127.0.0.1:7658/help/pagetemplate.html>bu sayfay\u0131</a> uyarlamaktan \u00e7ekinmeyin. \u0130\u00e7eri\u011fi d\u00fczenledikten sonra bu sayfaya geri d\u00f6nerseniz, taray\u0131c\u0131n\u0131z\u0131n web \u00f6nbelle\u011fini temizlemeyi deneyin.";
