    t[2292] = "Signed by";
    t[2293] = "\u0130mzalayan";
    t[2294] = "The <i class=example>default</i> threshold applies to any remote destination not explicitly listed in the definition or in any of the referenced files. To set a default threshold use the keyword <i class=example>default</i>.";
    t[2295] = "<i class=example>default</i> e\u015fi\u011fi, tan\u0131mda veya herhangi bir referans dosyas\u0131nda a\u00e7\u0131k\u00e7a listelenmeyen herhangi bir uzak hedefe uygulan\u0131r. Varsay\u0131lan bir e\u015fik tan\u0131mlamak i\u00e7in anahtar kelime <i class=example>default</i>'\u0131 kullan\u0131n.";
    t[2306] = "Estimated total leasesets";
    t[2307] = "Tahmini toplam kiralama setleri";
    t[2308] = "Building tunnels";
    t[2309] = "T\u00fcneller yap\u0131l\u0131yor";
    t[2310] = "Send on";
    t[2311] = "G\u00f6nderilme zaman\u0131";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Y\u00f6nelticinizin 10 ya da daha fazla etkin e\u015fi varsa, her \u015fey yolunda demektir. Y\u00f6neltici her zaman birka\u00e7 e\u015fle ba\u011flant\u0131y\u0131 s\u00fcrd\u00fcrmelidir. A\u011fa \"daha iyi ba\u011flanmak\" i\u00e7in en iyi yol, <a href=/config>daha fazla bant geni\u015fli\u011fi payla\u015fmak</a>.";
    t[2320] = "Not enough shared bandwidth to build transit tunnels.";
    t[2321] = "Transit t\u00fcneller in\u015fa etmek i\u00e7in yeterli payla\u015f\u0131lan bant geni\u015fli\u011fi yok.";
