    t[2339] = "Bir anahtar yazmal\u0131s\u0131n\u0131z";
    t[2342] = "SymmetricNAT";
    t[2343] = "SimetrikNAT";
    t[2364] = "Some basic indications of router overload:";
    t[2365] = "Y\u00f6nlendiricinin a\u015f\u0131r\u0131 y\u00fcklenmesinin baz\u0131 temel g\u00f6stergeleri:";
    t[2370] = "Glossary";
    t[2371] = "S\u00f6zl\u00fck";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Kendi alan ad\u0131n\u0131z\u0131 edinmek i\u00e7in, <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> veya <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> gibi I2P etki alan\u0131 kay\u0131t firmalar\u0131 kay\u0131t hizmetleri sa\u011flar. Bu hizmetlerle bir .i2p alan ad\u0131 veya alt alan ad\u0131 kaydedebilir ve y\u00f6netebilirsiniz. Kaydedilen bu alan ad\u0131 a\u011f\u0131 boyunca yay\u0131l\u0131r. Baz\u0131 kay\u0131t siteleri bir alan ad\u0131yla ili\u015fkilendirmek istedi\u011finiz t\u00fcnel/hizmet i\u00e7in <i>B64 hedef adres</i> gerektirebilir. Bu adresi <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>T\u00fcnel Y\u00f6neticisi Yap\u0131land\u0131rma sayfas\u0131</a>n\u0131n <i>Yerel Hedef</i> b\u00f6l\u00fcm\u00fcnden kopyalamal\u0131s\u0131n\u0131z.";
