    t[2426] = "Do not publicly publish the reseed file or share these files with a friend of a friend!";
    t[2427] = "Reseed dosyas\u0131n\u0131 kamuya a\u00e7\u0131k olarak yay\u0131nlamay\u0131n veya bu dosyalar\u0131 bir arkada\u015f\u0131n arkada\u015f\u0131yla payla\u015fmay\u0131n!";
