    t[2572] = "Plugin will be installed on next restart.";
    t[2573] = "Uygulama eki sonraki yeniden ba\u015flatmada kurulacak";
    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Kenar \u00c7ubu\u011fundaki bir\u00e7ok istatistik daha fazla analiz i\u00e7in <a href='/configstats'>ayarlanabilir</a> <a href='/graphs'>grafiklerle</a>. Kenar \u00c7ubu\u011funda g\u00f6r\u00fcnen b\u00f6l\u00fcmleri ve yerlerini de <a href='/configsidebar'>Kenar \u00c7ubu\u011fu Yap\u0131land\u0131rma sayfas\u0131nda</a> \u00f6zelle\u015ftirebilirsiniz.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2592] = "Max";
    t[2593] = "En B\u00fcy\u00fck";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "E\u011fer imzas\u0131z (.zip) I2P g\u00fcncellemelerini y\u00fcklemek isterseniz, bu se\u00e7enek, <code>router.config</code> dosyan\u0131za eklenmelidir. Ancak <code>routerconsole.advanced=true</code> zaten yap\u0131land\u0131r\u0131lm\u0131\u015fsa, bu se\u00e7enek zaten haz\u0131r olur. Not: I2P+ 0.9.48+ s\u00fcr\u00fcm\u00fcnden itibaren, <a href=/configupdate#i2pupdates>imzas\u0131z g\u00fcncellemeler</a> otomatik olarak etkinle\u015ftirilir.";
