    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "E\u011fer I2P y\u00f6neten ve g\u00fcvendi\u011finiz birisini tan\u0131yorsan\u0131z, onlardan size router konsollar\u0131ndaki bu sayfan\u0131n kullan\u0131larak \u00fcretilmi\u015f bir tohumlama dosyas\u0131 g\u00f6ndermelerini isteyin. Ard\u0131ndan, {0} \u00fczerinde size ula\u015fan dosyay\u0131 kullanarak <i>Dosyadan tohumlama</i> se\u00e7ene\u011fini belirleyin.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[2621] = "\u0130stemci t\u00fcnellerinde yaln\u0131zca oturuma y\u00f6nelik de\u011fi\u015fiklikleri etkinle\u015ftirmek i\u00e7in konsolun <a href=\"/help/advancedsettings\">Geli\u015fmi\u015f modunu</a> etkinle\u015ftirin.";
