    t[2681] = "A\u011f veritaban\u0131ndaki olas\u0131 sebilleri g\u00f6zden ge\u00e7ir";
    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "WAN Ethernet Ba\u011flant\u0131s\u0131 Yap\u0131land\u0131rmas\u0131";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Bu ayar (saniye cinsinden) NetDb'ye eklemek i\u00e7in yeni d\u00fc\u011f\u00fcmler bulmaya \u00e7al\u0131\u015fan Peer Exploration Job'un \u00e7al\u0131\u015fmas\u0131 aras\u0131ndaki gecikmeyi ge\u00e7ersiz k\u0131lman\u0131za olanak tan\u0131r. G\u00f6rev varsay\u0131lan olarak her 80 saniyede bir \u00e7al\u0131\u015facakt\u0131r veya y\u00f6nlendirici g\u00f6rev veya mesaj gecikmesi ya\u015f\u0131yorsa her 3 dakikada bir. NetDb'nin boyutu 4000 d\u00fc\u011f\u00fcmle\u015ftirildi\u011finde, durma s\u00fcresi 15 dakikaya \u00e7\u0131kacakt\u0131r. NetDb'nizin iyi dolu oldu\u011fu (2000'den fazla d\u00fc\u011f\u00fcm), veya toplam bant geni\u015fli\u011fi kullan\u0131m\u0131n\u0131 azaltmak istiyorsan\u0131z, gecikmeyi art\u0131rabilirsiniz. Not: Floodfill y\u00f6nlendiricileri i\u00e7in bu g\u00f6rev \u00e7al\u0131\u015fmaz.";
    t[2698] = "Current";
    t[2699] = "Ak\u0131m";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "I2P a\u011f\u0131ndaki bir web sitesidir. Varsay\u0131lan olarak, bir <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty web sunucusu</a> yap\u0131land\u0131r\u0131lm\u0131\u015f ve <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a> \u00fczerinde \u00e7al\u0131\u015f\u0131yor.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Durdurulabilir veya <a href=/i2ptunnelmgr>Tunnel Y\u00f6neticisi</a> \u00fczerinden de\u011fi\u015ftirilebilir. Ayr\u0131ca belirli bir aray\u00fcze veya t\u00fcm aray\u00fczlere ba\u011flanacak \u015fekilde yap\u0131land\u0131r\u0131labilir.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "I2P Hizmeti art\u0131k sistem ba\u015flang\u0131c\u0131nda etkinle\u015ftirildi";
    t[2748] = "Computer related news aggregation";
    t[2749] = "Bilgisayarla ilgili haber toplama";
    t[2752] = "Same IP as us";
    t[2753] = "Bizimle ayn\u0131 IP";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Burada yeni bir y\u00f6nlendirici ailesi olu\u015fturabilirsiniz. Aileyi olu\u015fturduktan sonra, aile anahtar dosyas\u0131n\u0131 d\u0131\u015fa aktarabilir ve aday g\u00f6sterilen ailenizdeki di\u011fer y\u00f6nlendiricilerle payla\u015fabilirsiniz.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Tunnels akran\u0131 kat\u0131lmay\u0131 kabul etti";
    t[2758] = "Advanced Lookup";
    t[2759] = "Geli\u015fmi\u015f Arama";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "I2P'de bar\u0131nd\u0131r\u0131lan web sitelerine eri\u015fmek ve iste\u011fe ba\u011fl\u0131 olarak varsay\u0131lan \u00e7\u0131kan (outproxy) kullanarak net \u00fczerindeki web sitelerine ba\u011flanmak i\u00e7in taray\u0131c\u0131n\u0131z\u0131 I2P HTTP proxy'si (varsay\u0131lan olarak <code>127.0.0.1 4444 numaral\u0131 portunda</code>) kullanacak \u015fekilde yap\u0131land\u0131rman\u0131z gerekmektedir. Taray\u0131c\u0131lar\u0131n \u00e7o\u011fu proxy yap\u0131land\u0131rmas\u0131 se\u00e7ene\u011fi sunar; bu mini e\u011fitimde Firefox \u00fczerine odaklanaca\u011f\u0131z.";
    t[2776] = "Close to us";
    t[2777] = "Bize yak\u0131n";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "I2P Y\u00f6nlendirici Site Haritas\u0131";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "\u0130ndirilen uygulama ekinin s\u00fcr\u00fcm\u00fc {0} kurulu uygulama ekinden daha yeni de\u011fil";
    t[2796] = "Streaming radio service";
    t[2797] = "Radyo hizmeti yay\u0131n\u0131";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+, <a href=/config>bant geni\u015fli\u011fi yap\u0131land\u0131rma b\u00f6l\u00fcm\u00fcnde</a> a\u011f ba\u011flant\u0131n\u0131z\u0131n h\u0131z\u0131n\u0131 do\u011fru bir \u015fekilde yans\u0131tabildi\u011finizde en iyi \u015fekilde \u00e7al\u0131\u015f\u0131r. Varsay\u0131lan olarak, I2P+ bir\u00e7ok kullan\u0131m durumuna uygun olmayan olduk\u00e7a muhafazakar de\u011ferlerle yap\u0131land\u0131r\u0131lm\u0131\u015ft\u0131r, bu nedenle l\u00fctfen bu ayarlar\u0131 g\u00f6zden ge\u00e7irin ve gerekti\u011finde d\u00fczeltin. Daha fazla bant geni\u015fli\u011fi, <i>\u00f6zellikle</i> yukar\u0131 do\u011fru bant geni\u015fli\u011fi ne tahsis ederseniz, a\u011fdan o kadar fazla fayda sa\u011flars\u0131n\u0131z.";
    t[2810] = "Transit by Peer";
    t[2811] = "E\u015f Taraf\u0131ndan Transit";
    t[2812] = "Hidden Mode";
    t[2813] = "Gizli Mod";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "Uygulama eki i\u00e7in Jetty {0} ya da \u00f6nceki bir s\u00fcr\u00fcm gereklidir";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "Proxy, uzaktan bar\u0131nd\u0131r\u0131lan bir hizmet veya bilgisayar\u0131n\u0131zda \u00e7al\u0131\u015fan bir servis olabilir (localhost/127.0.0.1).";
    t[2824] = "Events in peak period";
    t[2825] = "En yo\u011fun d\u00f6nemdeki etkinlikler";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "Y\u00f6nlendirici Konsolu ve WebApps G\u00f6r\u00fcnt\u00fc Dili";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "I2P+ \u00e7al\u0131\u015fm\u0131yorsa ne yap\u0131lmal\u0131";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "\u0130S\u0130MS\u0130ZL\u0130K UYARISI - Ayarlarda 1 s\u0131\u00e7rama t\u00fcneli var.";
    t[2858] = "I2P IRC Network";
    t[2859] = "I2P IRC A\u011f\u0131";
    t[2864] = "pixels wide";
    t[2865] = "piksel geni\u015fli\u011finde";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "I2P A\u011f Protokol\u00fc (I2NP), bir peer ile ileti\u015fim kurarken, y\u00f6nlendirici aras\u0131nda mesajlar\u0131n y\u00f6nlendirilmesi ve kar\u0131\u015ft\u0131r\u0131lmas\u0131n\u0131, ayr\u0131ca ileti\u015fimde birden fazla ta\u015f\u0131ma se\u00e7ene\u011fi oldu\u011funda (desteklenenlerden biri) ta\u015f\u0131ma se\u00e7imini y\u00f6netir. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelendirmeye</a> bak\u0131n.";
    t[2884] = "Expired {0} ago";
    t[2885] = "{0} \u00f6nce bitti";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Y\u00f6nl\u00fcn\u00fcz\u00fcn, di\u011fer y\u00f6nl\u00fclerden y\u00f6nl\u00fcn\u00fcz \u00fczerinden bir t\u00fcnel olu\u015fturma isteklerini kabul etme veya reddetme durumu. Y\u00f6nl\u00fc, bant geni\u015fli\u011fi ve CPU taleplerini kontrol etmek ve yerel istemciler i\u00e7in kapasiteyi korumak i\u00e7in bir dizi nedenle t\u00fcm istekleri kabul edebilir, kabul edebilir veya reddedebilir. <b>Not";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "L\u00fctfen \u00e7al\u0131\u015fan bir I2P y\u00f6nlendiricisi olan g\u00fcvenilir bir arkada\u015f\u0131n\u0131za ba\u015fvurun ve I2P y\u00f6nlendiricinizi yeniden \u00e7ekim yap\u0131lmas\u0131 konusunda size yard\u0131mc\u0131 olmas\u0131n\u0131 isteyin. \u00c7al\u0131\u015fan I2P y\u00f6nlendiricilerinden d\u0131\u015fa aktar\u0131lm\u0131\u015f bir yeniden \u00e7ekim dosyas\u0131n\u0131 size g\u00f6ndermelerini isteyin. Dosyan\u0131n g\u00fcvenli bir kanal \u00fczerinden, \u00f6rne\u011fin \u015fifrelenerek, d\u0131\u015f m\u00fcdahalelere kar\u015f\u0131 korundu\u011fundan emin olun (PGP \u0130mzalama, \u015eifreleme ve g\u00fcvenilir bir genel anahtarla do\u011frulama). Dosya kendisi imzas\u0131zd\u0131r, bu y\u00fczden sadece tan\u0131nan g\u00fcvendi\u011finiz arkada\u015flardan dosya kabul edin. Kayna\u011f\u0131n\u0131 do\u011frulayam\u0131yorsan\u0131z, asla bir yeniden \u00e7ekim dosyas\u0131 y\u00fckleme.";
    t[2916] = "Last Good Send";
    t[2917] = "Son \u0130yi G\u00f6nderim";
    t[2918] = "Delete this value to disable";
    t[2919] = "Devre d\u0131\u015f\u0131 b\u0131rakmak i\u00e7in bu de\u011feri silin";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Bir kaydediciyi, ba\u015fka bir t\u00fcnelin veya birden fazla t\u00fcnelin h\u0131z k\u0131s\u0131tlama i\u00e7in kullanabilece\u011fi bir dosyaya yazan bir t\u00fcneld\u0435 kullanabilirsiniz. Bu dosyalar ayr\u0131ca elle d\u00fczenlenebilir.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
