    t[2935] = "Bizim saatimize g\u00f6re akran saatinin \u00e7arp\u0131kl\u0131\u011f\u0131";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "\u0130hlal edilen bir e\u015fik de\u011feri, su\u00e7lu uzak hedefin belirli bir dosyada kaydedilmesine neden olur";
