    t[2939] = "Bu sorun genellikle bir 7654 numaral\u0131 kap\u0131n\u0131n \u00e7ak\u0131\u015fmas\u0131ndan kaynaklan\u0131r. Do\u011frulamak i\u00e7in g\u00fcnl\u00fck kay\u0131tlar\u0131na bak\u0131n.";
    t[2940] = "Disabling inbound TCP";
