    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "Do\u011frulanm\u0131\u015f aile (imza sertifikas\u0131 y\u00fckl\u00fc ve ge\u00e7erli)";
    t[2954] = "Router info not available";
    t[2955] = "Y\u00f6nlendirici bilgisi mevcut de\u011fil";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "A\u015fa\u011f\u0131da listelenen Java web uygulamalar\u0131 web konsolu istemcisi taraf\u0131ndan ba\u015flat\u0131lm\u0131\u015f ve y\u00f6neltici ile ayn\u0131 Java Sanal Makinas\u0131 \u00fczerinde \u00e7al\u0131\u015f\u0131yor. Bunlar genellikle y\u00f6neltici konsolu \u00fczerinden eri\u015filebilen web uygulamalar\u0131d\u0131r. Bunlar, tam uygulamalar (i2psnark gibi), ayr\u0131ca etkinle\u015ftirilmesi gereken farkl\u0131 bir istemcinin ya da uygulaman\u0131n \u00f6n y\u00fcz\u00fc (susidns, i2ptunnel gibi) ya da web aray\u00fcz\u00fc olmayan (adres defteri gibi) uygulamalar olabilir.";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "UYARI - Gizli y\u00f6nlendiriciler i\u00e7in gelen 0 atlamal\u0131 t\u00fcneller \u00f6nerilmez.";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP Vekil Sunucusu";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Bu, y\u00f6nlendiriciniz taraf\u0131ndan bilinen toplam d\u00fc\u011f\u00fcm say\u0131s\u0131d\u0131r. Onlar <a href='/netdb'>A\u011f Veritaban\u0131 sayfas\u0131nda</a> listelenmi\u015ftir. Bu say\u0131 a\u011f\u0131n toplam b\u00fcy\u00fckl\u00fc\u011f\u00fc de\u011fildir; tamamen bant geni\u015fli\u011finize, payla\u015f\u0131lan bant geni\u015fli\u011finize ve yerel olarak \u00fcretilen trafi\u011fe ba\u011fl\u0131 olarak geni\u015f bir yelpazede de\u011fi\u015febilir. I2P, bir y\u00f6nlendiricinin a\u011fdaki her y\u00f6nlendiriciyi bilmesini gerektirmez.";
