    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Dizin listesinin <a href=http://127.0.0.1:7658/help/images/>varsay\u0131lan g\u00f6r\u00fcn\u00fcm\u00fcn\u00fc</a> de\u011fi\u015ftirerek d\u00fczenlenmi\u015f bir <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> dosyas\u0131 sa\u011flayarak genel bir g\u00f6r\u00fcn\u00fcm belirleyebilirsiniz. Bu dosyan\u0131n web sunucusunun dizin listesinde g\u00f6r\u00fcnt\u00fclenmeyece\u011fini unutmay\u0131n. Dosyalar ve . ile ba\u015flayan dizinler ve favicon.ico adl\u0131 dosyalar veya ~ veya .bak veya .old ile biten dosyalar da g\u00f6r\u00fcnmez olacakt\u0131r (ancak hala eri\u015filebilir olacakt\u0131r). Not: Windows \u00fczerinde . ile ba\u015flayan gizli dosyalar olu\u015fturmak i\u00e7in, dosyaya veya dizine sonuna bir nokta . ekleyin, \u00f6rne\u011fin <code>.gizli.</code>; Windows gezgini dosyay\u0131 do\u011fru isimle kaydedecek ve son noktay\u0131 kald\u0131racakt\u0131r.";
