    t[3093] = "Bu, ilgili istemci hizmetinin yap\u0131land\u0131rma sayfas\u0131ndaki <i>Di\u011fer yap\u0131land\u0131r\u0131lm\u0131\u015f istemcilerle t\u00fcnelleri payla\u015f</i> se\u00e7ene\u011finin i\u015faretini kald\u0131rarak yap\u0131labilir. Bunun ard\u0131ndan <a href=/i2ptunnelmgr>T\u00fcnel Y\u00f6neticisi ana sayfas\u0131ndan</a> istemci hizmetini yeniden ba\u015flatman\u0131z gerekecektir.";
