    t[3166] = "Total number of tunnels in use";
    t[3167] = "Kullan\u0131lan toplam t\u00fcnel say\u0131s\u0131";
    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "True olarak ayarland\u0131\u011f\u0131nda, konsolda ek i\u015flevsellik etkinle\u015ftirilecek ve kullan\u0131c\u0131 <a href=/configadvanced>Geli\u015fmi\u015f Yap\u0131land\u0131rma sayfas\u0131nda</a> do\u011frudan ayarlar\u0131 d\u00fczenleyebilecek. <a href=/netdb>A\u011f Veritaban\u0131 b\u00f6l\u00fcm\u00fcnde</a> ekstra g\u00f6r\u00fcnt\u00fcleme se\u00e7enekleri sunulur, bunlar aras\u0131nda <a href='/netdb?f=3'>Sybil Analiz arac\u0131</a> bulunur ve <a href=/configclients>\u0130stemci Yap\u0131land\u0131rma sayfas\u0131nda</a> ek yap\u0131land\u0131rma se\u00e7enekleri vard\u0131r. Bu ayr\u0131ca imzas\u0131z g\u00fcncelle\u015ftirmelerin y\u00fcklenmesini, haber URL'sinin manuel olarak yap\u0131land\u0131r\u0131lmas\u0131n\u0131 ve kenar \u00e7ubu\u011funda ek b\u00f6l\u00fcmlerin etkinle\u015ftirilmesini sa\u011flar.";
