    t[3298] = "Active and scheduled jobs";
    t[3299] = "Aktif ve planlanm\u0131\u015f i\u015fler";
    t[3302] = "This is an experimental network database tool for debugging and analysis. Do not panic even if you see warnings indicated. Possible \"threats\" are summarized, however these are unlikely to be real threats. If you see anything you would like to discuss with the devs, contact us on IRC #i2p-dev.";
    t[3303] = "Bu, hata ay\u0131klama ve analiz i\u00e7in deneysel bir a\u011f veritaban\u0131 arac\u0131d\u0131r. Belirtildi\u011fini g\u00f6rseniz bile panik yapmay\u0131n. Olas\u0131 \"tehditler\" \u00f6zetlenir, ancak bunlar\u0131n ger\u00e7ek tehditler olmas\u0131 olas\u0131 de\u011fildir. Devs ile tart\u0131\u015fmak istedi\u011finiz bir \u015fey g\u00f6r\u00fcrseniz, IRC #i2p-dev'de bizimle ileti\u015fime ge\u00e7in.";
    t[3308] = "For assistance, see the {0}";
    t[3309] = "Yard\u0131m i\u00e7in bkz. {0}";
