    t[3318] = "if we are not firewalled";
    t[3319] = "g\u00fcvenlik duvar\u0131 arkas\u0131nda de\u011filsek";
    t[3322] = "A <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> link (which always ends with .b32.i2p) is a hash of a <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a> destination. For services on the network, the Base64 hash is often mapped to an .i2p domain in the addressbook.";
    t[3323] = "Her zaman .b32.i2p ile biten bir <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> ba\u011flant\u0131s\u0131, bir <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a> hedefinin karma de\u011feridir. A\u011fdaki hizmetler i\u00e7in, Base64 karma de\u011feri genellikle adres defterinde bir .i2p etki alan\u0131na e\u015flenir.";
    t[3326] = "Please enable sharing (participating in tunnels) by configuring more bandwidth. ";
    t[3327] = "L\u00fctfen bant geni\u015fli\u011fini artt\u0131rarak (t\u00fcnellere katk\u0131da bulunarak) payla\u015f\u0131m\u0131 etkinle\u015ftirin.";
