    t[3396] = "A fork of the <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent client</a> refactored for use on the I2P network. Usually supplied as part of the default suite of applications with Java I2P, and also available as a <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>standalone Java application</a>.";
    t[3397] = "I2P a\u011f\u0131 i\u00e7in yeniden d\u00fczenlenmi\u015f olan <a href=http://www.klomp.org/snark/ class='sitelink external' target=_blank rel=noreferrer>Snark BitTorrent istemcisinden t\u00fcretilmi\u015f bir \u00e7atalla birlikte gelir. Genellikle Java I2P'nin varsay\u0131lan uygulama paketi olarak sunulur ve ayr\u0131ca <a href=http://skank.i2p/#download class=sitelink target=_blank rel=noreferrer>ba\u011f\u0131ms\u0131z bir Java uygulamas\u0131 olarak da mevcuttur</a>.";
