    t[3416] = "If you are running the Tor Browser, you may use its Tor instance by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9150</code>.";
    t[3417] = "Tor Taray\u0131c\u0131s\u0131 kullan\u0131yorsan\u0131z, I2P'yi yap\u0131land\u0131rarak Tor \u00f6rne\u011fini kullanabilirsiniz: <i>Proxy t\u00fcr\u00fc:</i> <code>SOCKS 5</code> <i>Ana bilgisayar:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9150</code>.";
    t[3428] = "Use IPv6 only (disable IPv4)";
    t[3429] = "Yaln\u0131z IPv6 kullan\u0131ls\u0131n (IPv4 kullan\u0131lmas\u0131n)";
    t[3432] = "If set to true, this option will place an icon in the system tray / notification area, with basic service control options. [Disabled by default]";
    t[3433] = "True olarak ayarlan\u0131rsa, bu se\u00e7enek temel hizmet kontrol se\u00e7enekleriyle birlikte sistem tepsisine / bildirim alan\u0131na bir simge yerle\u015ftirir. [Varsay\u0131lan olarak devre d\u0131\u015f\u0131]";
    t[3440] = "Windows";
    t[3441] = "Windows";
    t[3444] = "Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[3445] = "Bunu yaln\u0131z HTTPS bir g\u00fcvenlik taraf\u0131ndan engelleniyor ve yeniden tohumlama yap\u0131lam\u0131yor ise de\u011fi\u015ftirin.";
