    t[3464] = "This setting configures the initial size of the outbound message queue. [Default is 64]";
    t[3465] = "Bu ayar, ba\u015flang\u0131\u00e7ta d\u0131\u015far\u0131ya g\u00f6nderilecek mesaj kuyru\u011funun boyutunu yap\u0131land\u0131r\u0131r. [Varsay\u0131lan de\u011fer 64]";
    t[3466] = "Larger interval";
