    t[3473] = "\u00f6nce";
    t[3476] = "Threads dumped to {0}";
    t[3477] = "\u0130zlekler {0} \u00fczerine kaydedildi";
    t[3480] = "Bandwidth in/out";
    t[3481] = "Bant geni\u015fli\u011fi gelen/giden";
    t[3482] = "This setting determines whether stats about our router are sporadically published to the NetDb. [Default is false]";
    t[3483] = "Bu ayar, y\u00f6nlendiricimizle ilgili istatistiklerin d\u00fczenli olarak NetDb'ye yay\u0131nlan\u0131p yay\u0131nlanmayaca\u011f\u0131n\u0131 belirler. [Varsay\u0131lan false]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Bu, y\u00f6nlendiricinizin istemci t\u00fcnelleri olu\u015fturmak i\u00e7in kullan\u0131labilen e\u015f say\u0131s\u0131d\u0131r. Genellikle 8-30 aral\u0131\u011f\u0131nda olur. H\u0131zl\u0131 e\u015fleriniz <a href='/profiles'>Profiller sayfas\u0131nda</a> g\u00f6sterilir. <a href='/configstats#router.fastPeers'>[Grafiklemeyi etkinle\u015ftir]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "<i>Dosyadan Yeniden \u00c7ekim</i> d\u00fc\u011fmesine t\u0131klay\u0131n";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Trafik analizi yapmay\u0131 zorla\u015ft\u0131rmak ve veri transferi h\u0131z\u0131n\u0131 art\u0131rmak amac\u0131yla birden fazla iletiyi birlikte \u015fifreleyen so\u011fan y\u00f6nlendirme y\u00f6nteminin bir \u00e7e\u015fididir. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelere</a> bak\u0131n.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "WordPress Sitenizi Nas\u0131l G\u00fc\u00e7lendirebilirsiniz?";
    t[3496] = "I2P Internals";
    t[3497] = "I2P Bilgileri";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Varsay\u0131lan olarak, I2P, kendi anonimle\u015ftirilmi\u015f web sitenizi (geleneksel olarak <i>eepsite</i> olarak adland\u0131r\u0131l\u0131r) bar\u0131nd\u0131rmak i\u00e7in bir web sunucusu ile birlikte gelir. Hem site hem de I2P Rotalay\u0131c\u0131 Konsolu, I2P i\u00e7in \u00f6zelle\u015ftirilmi\u015f bir Jetty'nin sadele\u015ftirilmi\u015f bir s\u00fcr\u00fcm\u00fcnde \u00e7al\u0131\u015f\u0131yor.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Bu ayar, NetDb'nizden daha eski y\u00f6nlendiricileri hari\u00e7 tutman\u0131za olanak sa\u011flar. Varsay\u0131lan veya belirledi\u011finiz de\u011ferden daha eski y\u00f6nlendiriciler, NetDb'den silinecek ve y\u00f6nlendirici oturumunun s\u00fcresi boyunca yasaklanacakt\u0131r. Varsay\u0131lan olarak, 0.9.20'den daha eski y\u00f6nlendiriciler hari\u00e7 tutulur. Not: I2P+ s\u00fcr\u00fcm\u00fc 0.9.46+ ile birlikte, sadece \u00e7ok yeni s\u00fcr\u00fcmler \u00e7al\u0131\u015fan y\u00f6nlendiriciler yerel t\u00fcnellerin olu\u015fturulmas\u0131 i\u00e7in kullan\u0131l\u0131r. [Yeniden ba\u015flatma gerekiyor]";
    t[3508] = "HackerNews";
    t[3509] = "HackerHaberleri";
