    t[3560] = "To update with unsigned I2P+ release builds: <code>http://skank.i2p/i2pupdate.zip</code> or for the latest unsigned development builds: <code>http://skank.i2p/dev/i2pupdate.zip</code>";
    t[3561] = "\u0130mzas\u0131z I2P s\u00fcr\u00fcm derlemeleriyle g\u00fcncellemek i\u00e7in: <code>http://skank.i2p/i2pupdate.zip</code> veya en son imzas\u0131z geli\u015ftirme derlemeleri i\u00e7in: <code>http://skank.i2p/dev/i2pupdate</code>";
    t[3564] = "Invalid form submission, probably because you used the 'back' or 'reload' button on your browser. Please resubmit.";
    t[3565] = "Form g\u00f6nderimi ge\u00e7ersiz. Taray\u0131c\u0131n\u0131z\u0131n \"geri\" ya da \"yenile\" d\u00fc\u011fmelerini kulland\u0131\u011f\u0131n\u0131zdan olabilir. L\u00fctfen formu yeniden g\u00f6nderin.";
    t[3566] = "Restart Status";
    t[3567] = "Yeniden Ba\u015flatma Durumu";
    t[3568] = "IPv6 Configuration";
    t[3569] = "IPv6 Yap\u0131land\u0131rmas\u0131";
    t[3578] = "Peak throughput (bytes per second) over a 1 minute period that the peer has sustained in a single tunnel.";
    t[3579] = "E\u015fin tek bir t\u00fcnelde sa\u011flad\u0131\u011f\u0131 1 dakikal\u0131k s\u00fcre boyunca en y\u00fcksek aktar\u0131m h\u0131z\u0131 (saniye ba\u015f\u0131na bayt).";
    t[3582] = "Known high capacity peers";
    t[3583] = "Bilinen y\u00fcksek kapasiteli e\u015fler";
    t[3586] = "Proxy to connect to I2P's anonymized IRC chat network";
    t[3587] = "I2P'nin anonimle\u015ftirilmi\u015f IRC sohbet a\u011f\u0131na ba\u011flanmak i\u00e7in proxy";
    t[3588] = "After reporting, please restart your router";
    t[3589] = "Raporlamadan sonra l\u00fctfen y\u00f6nlendiricinizi yeniden ba\u015flat\u0131n.";
    t[3598] = "No longer be a member of the family {0}.";
    t[3599] = "Art\u0131k {0} ailesinin bir \u00fcyesi de\u011fil.";
    t[3600] = "No password entered";
    t[3601] = "Bir parola yazmal\u0131s\u0131n\u0131z";
    t[3604] = "Enabling this mode will prevent participating traffic";
    t[3605] = "Bu modun etkinle\u015ftirilmesi trafi\u011fin kat\u0131l\u0131m\u0131n\u0131 engelleyecektir";
    t[3618] = "ERR - Clock Skew";
    t[3619] = "HATA-Saat Sapmas\u0131";
    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "Bu ayar, y\u00f6nlendiricinin <i>blocklist.txt</i> dosyas\u0131n\u0131 ve kullan\u0131c\u0131 yap\u0131land\u0131rmal\u0131 engelleme listelerini kullanarak y\u00f6nlendiricilerin hash veya IP adresine g\u00f6re yasaklanmas\u0131n\u0131 etkinle\u015ftirip etkinle\u015ftirmeyece\u011fini belirler. IPv4 i\u00e7in aral\u0131klar ve a\u011f maskeleri desteklenir, ancak IPv6 i\u00e7in desteklenmez. Daha fazla bilgi i\u00e7in I2P+ uygulama dizininizdeki <i>blocklist.txt</i>'yi g\u00f6r\u00fcnt\u00fcleyin. [Varsay\u0131lan olarak etkin, yeniden ba\u015flatma gereklidir]";
    t[3626] = "Licensing and copyright notices";
    t[3627] = "Lisanslama ve telif hakk\u0131 bildirimleri";
    t[3634] = "Official I2P Source Repository";
    t[3635] = "Resmi I2P Kaynak Havuzu";
    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "Port 123 \u00fczerinden giden UDP trafi\u011fi, yan\u0131tlara izin verilir: Bu, I2P'nin i\u00e7 zaman senkronizasyonu i\u00e7in gereklidir (SNTP arac\u0131l\u0131\u011f\u0131yla - <code>pool.ntp.org</code> adresindeki rastgele bir SNTP sunucusuna sorgu yaparak veya <a href=/help/advancedsettings#ntpserverconfig>belirledi\u011finiz ba\u015fka bir sunucu</a>).";
    t[3646] = "NetDb Search";
    t[3647] = "NetDb Arama";
    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "XChat benzeri istemci kullan\u0131c\u0131lar\u0131, sunucu <code>127.0.0.1/6668</code> ile yeni bir a\u011f olu\u015fturabilirler (e\u011fer bir proxy sunucusu yap\u0131land\u0131rd\u0131ysan\u0131z <i>Proxy sunucusunu atla</i> i\u015faretini unutmay\u0131n) veya komut kullanarak ba\u011flanabilirsiniz: <code>/server 127.0.0.1 6668</code>. Farkl\u0131 IRC istemcileri s\u00f6zdizimini de\u011fi\u015ftirebilir.";
    t[3656] = "API";
    t[3657] = "API";
    t[3666] = "config networking";
    t[3667] = "a\u011f yap\u0131land\u0131rmas\u0131";
