    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "A\u015fa\u011f\u0131da listelenen y\u00f6nlendirici yap\u0131land\u0131rma se\u00e7enekleri kullan\u0131c\u0131 aray\u00fcz\u00fcnde mevcut de\u011fildir, genellikle nadiren kullan\u0131l\u0131r veya \u00e7o\u011fu kullan\u0131c\u0131n\u0131n ihtiya\u00e7 duymayaca\u011f\u0131 geli\u015fmi\u015f ayarlara eri\u015fim sa\u011flar. Bu eksiksiz bir liste de\u011fildir. Baz\u0131 ayarlar\u0131n etkili olmas\u0131 i\u00e7in y\u00f6nlendiriciyi yeniden ba\u015flatman\u0131z gerekebilir. T\u00fcm ayarlar\u0131n b\u00fcy\u00fck/k\u00fc\u00e7\u00fck harfe duyarl\u0131 oldu\u011funu unutmay\u0131n. Se\u00e7enek eklemek i\u00e7in <code>router.config</code> dosyan\u0131z\u0131 d\u00fczenlemeniz gerekecek veya <code>router.config</code> dosyas\u0131na <code>routerconsole.advanced=true</code> ekledikten sonra, ayarlar\u0131 konsol i\u00e7inde <a href=/configadvanced>Geli\u015fmi\u015f Yap\u0131land\u0131rma sayfas\u0131nda</a> d\u00fczenleyebilirsiniz.";
