    t[3754] = "When set to true, your router will not be classified as slow, regardless of the specifications of your host system. Ordinarily, routers running on hosts with the following characteristics will be classified as slow, and various performance-related router options will be modified accordingly:";
    t[3755] = "True olarak ayarland\u0131\u011f\u0131nda, ana sistem \u00f6zelliklerine bak\u0131lmaks\u0131z\u0131n y\u00f6nlendiriciniz yava\u015f olarak s\u0131n\u0131fland\u0131r\u0131lmaz. Genellikle, a\u015fa\u011f\u0131daki \u00f6zelliklere sahip ana sistemlerde \u00e7al\u0131\u015fan y\u00f6nlendiriciler yava\u015f olarak s\u0131n\u0131fland\u0131r\u0131l\u0131r ve \u00e7e\u015fitli performansla ilgili y\u00f6nlendirici se\u00e7enekleri buna g\u00f6re de\u011fi\u015ftirilir:";
