    t[3780] = "To preserve anonymity, make sure that the webserver is not publicly available outside of the I2P network, which is normally achieved by configuring the webserver to listen on localhost (127.0.0.1) rather than all interfaces (0.0.0.0).";
    t[3781] = "Anonimli\u011fi korumak i\u00e7in, web sunucusunun I2P a\u011f\u0131n\u0131n d\u0131\u015f\u0131nda herkese a\u00e7\u0131k olarak bulunmad\u0131\u011f\u0131ndan emin olun; bu, web sunucusunu t\u00fcm aray\u00fczler (0.0.0.0) yerine LocalHost'ta (127.0.0.1) dinleyecek \u015fekilde yap\u0131land\u0131rarak elde edilir.";
