    t[3831] = "Istemci uygulamalar\u0131 taraf\u0131ndan kullan\u0131l\u0131r. <a href=/configclients>\u0130stemci Yap\u0131land\u0131rma sayfas\u0131nda</a> farkl\u0131 bir ba\u011flant\u0131 noktas\u0131na de\u011fi\u015ftirilebilir ancak bu \u00f6nerilmez. <a href=/configclients>\u0130stemci Yap\u0131land\u0131rmas\u0131 sayfas\u0131nda</a> farkl\u0131 bir aray\u00fcze veya t\u00fcm aray\u00fczlere ba\u011flanabilir veya devre d\u0131\u015f\u0131 b\u0131rak\u0131labilir.";
