    t[3839] = "\u00c7e\u015fitli taray\u0131c\u0131lar i\u00e7in daha kapsaml\u0131 bir yap\u0131land\u0131rma k\u0131lavuzu i\u00e7in <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>taray\u0131c\u0131 yap\u0131land\u0131rma k\u0131lavuzunu</a> inceleyin.";
    t[3842] = "Periodically test tunnels to determine the average lag, and display the results in the Congestion sidepanel section. To enable, set this value to false. [Default is false]";
