    t[3958] = "I2P requires your computer's time be accurate.";
    t[3959] = "I2P y\u00f6nelticisinin \u00e7al\u0131\u015fabilmesi i\u00e7in saat ayar\u0131n\u0131n do\u011fru olmas\u0131 gereklidir.";
    t[3960] = "Just finished jobs";
    t[3961] = "Az \u00f6nce biten g\u00f6revler";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Baz\u0131 IRC istemcileri, bir s\u00fcre boyunca sunucuyla ileti\u015fim olmad\u0131ysa sunucudan ayr\u0131lmak \u00fczere yap\u0131land\u0131r\u0131lm\u0131\u015f olabilir, bu durum I2P IRC i\u00e7in sorun olabilir e\u011fer <i>ping s\u00fcresi a\u015f\u0131m\u0131</i> de\u011feri \u00e7ok d\u00fc\u015f\u00fckse. \u0130stemcinizdeki ping s\u00fcresi a\u015f\u0131m\u0131n\u0131 y\u00fcksek bir de\u011fere ayarlamak (\u00f6r. 320 saniye) genellikle a\u011fa daha sa\u011flam bir ba\u011flant\u0131 sa\u011flayacakt\u0131r. HexChat'te bu de\u011feri ayarlamak i\u00e7in <code>/set net_ping_timeout 320</code> komutunu yazabilirsiniz. Bu de\u011fer <code>hexchat.conf</code> dosyan\u0131za yaz\u0131lacakt\u0131r.";
    t[3964] = "Run at Startup?";
    t[3965] = "Ba\u015flang\u0131\u00e7ta \u00c7al\u0131\u015ft\u0131r\u0131ls\u0131n";
    t[3972] = "Never";
    t[3973] = "Asla";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Sisteminizin bulundu\u011fu genel ip adresi de\u011fi\u015fti\u011finde otomatik olarak <a href=/confignet#ipchange>iste\u011fe ba\u011fl\u0131 yap\u0131land\u0131rma</a> olarak <a href=/netdb?r=.>y\u00f6nlendirici kimli\u011finizi</a> ve <a href=/confignet#udpconfig>harici ba\u011flant\u0131 noktas\u0131n\u0131</a> de\u011fi\u015ftirir. Bu, \u00f6rne\u011fin diz\u00fcst\u00fc bilgisayardan farkl\u0131 konumlarda I2P \u00e7al\u0131\u015ft\u0131rd\u0131\u011f\u0131n\u0131z durumlarda ip adresinizin s\u0131kl\u0131kla de\u011fi\u015febilece\u011fi senaryolarda y\u00f6nlendirici kimli\u011finiz ve ip adresinizi ili\u015fkilendiren sald\u0131rgan\u0131n \u00f6n\u00fcne ge\u00e7ebilir.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Y\u00f6neltici kendi adresini yay\u0131nlamayacak \u015fekilde yap\u0131land\u0131r\u0131lm\u0131\u015f oldu\u011fundan gelen ba\u011flant\u0131lar\u0131 beklemiyor.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "I2P+ ile birlikte verilen komut sat\u0131r\u0131 uygulamas\u0131d\u0131r (Linux/MacOS) ve a\u011fdaki belirtilen bir http kayna\u011f\u0131 \u00fczerinde bir <code>head</code> iste\u011fi yapmak ve uzak sunucudan \u00e7e\u015fitli yan\u0131t ba\u015fl\u0131klar\u0131 d\u00f6nd\u00fcrmek i\u00e7in kullan\u0131l\u0131r. Varsay\u0131lan olarak, eephead <code>127.0.0.1:4444</code> \u00fczerindeki HTTP proxy'sini kullan\u0131r.";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
