    t[4053] = "\u0130\u015f \u0130statistikleri (tek seferlik i\u015fler hari\u00e7)";
    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "I2P a\u011f\u0131nda bar\u0131nd\u0131r\u0131lan web sitelerine eri\u015fmek ve iste\u011fe ba\u011fl\u0131 olarak ClearNet'teki web sitelerine ba\u011flanmak i\u00e7in varsay\u0131lan outproxy kullanabilmek i\u00e7in, taray\u0131c\u0131n\u0131z\u0131 varsay\u0131lan olarak \u00e7al\u0131\u015farak I2P+ <b>HTTP</b> proxy'ini kullanacak \u015fekilde yap\u0131land\u0131rman\u0131z gerekecektir. Kod>127.0.0.1 ba\u011flant\u0131 noktas\u0131 4444</code>. Daha fazla yard\u0131m i\u00e7in bkz. <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>Yap\u0131land\u0131rma K\u0131lavuzu</a> veya <a href=/help/configuration#browserconfig>Firefox i\u00e7in Mini-Tutorical</a>.";
