    t[4667] = "I2P, I2P a\u011f\u0131ndaki web sitelerine g\u00f6z atmak i\u00e7in yerle\u015fik HTTP proxy'sini kullanacak \u015fekilde yap\u0131land\u0131r\u0131lm\u0131\u015f bir web taray\u0131c\u0131s\u0131 gerektirir.";
    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "\u00c7al\u0131\u015ft\u0131rd\u0131\u011f\u0131n\u0131z I2P yaz\u0131l\u0131m\u0131n\u0131n s\u00fcr\u00fcm\u00fc. E\u011fer yeni bir s\u00fcr\u00fcm mevcutsa, kenar \u00e7ubu\u011funda bildirim alacaks\u0131n\u0131z. Optimal performans ve g\u00fcvenlik i\u00e7in y\u00f6nlendiricinizi g\u00fcncel tutman\u0131z \u00f6nerilir. Y\u00f6nlendirici g\u00fcncellemeleri genellikle ortalama olarak her 2-3 ayda bir sunulur.";
    t[4684] = "Router Statistics";
