    t[4697] = "IPv6 yerine IPv4 kullan\u0131ls\u0131n";
    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (NIO tabanl\u0131 TCP) ve NTCP2, a\u011fdaki y\u00f6nlendiriciler aras\u0131nda I2NP iletilerini iletmek i\u00e7in Java'n\u0131n NIO (Yeni Giri\u015f/\u00c7\u0131k\u0131\u015f) TCP uygulamas\u0131n\u0131 kullanan TCP tabanl\u0131 a\u011f ta\u015f\u0131mac\u0131l\u0131\u011f\u0131d\u0131r. NTCP2, NTCP'nin \u00e7e\u015fitli sald\u0131r\u0131lara ve otomatik trafik tan\u0131mlama y\u00f6ntemlerine kar\u015f\u0131 direncini art\u0131r\u0131r. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelere</a> bak\u0131n.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Sald\u0131rgan istemcilerin hedeflerini belirli bir dosyaya kaydetmek i\u00e7in bir kaydedici kullanabilir ve daha sonra ayn\u0131 dosyay\u0131 kullanarak onlar\u0131 h\u0131z k\u0131s\u0131tlamaya alabilirsiniz. A\u015fa\u011f\u0131daki \u00f6rnek, ba\u015flang\u0131\u00e7ta t\u00fcm ba\u011flant\u0131 isteklerine izin veren ancak herhangi bir tek hedefin 60 saniye i\u00e7inde 180 iste\u011fi a\u015fmas\u0131 durumunda onu 60 saniyede 30 istekle k\u0131s\u0131tlayan bir filtre tan\u0131mlar:";
