    t[4822] = "Be aware that a poorly configured webserver or web appplication can leak information such as your real IP address or server details that may reduce your anonymity or assist a hacker. If using an alternative platform, be sure to secure it before putting it online. If in doubt, consult online guides about web server and web application hardening, for example:";
    t[4823] = "K\u00f6t\u00fc yap\u0131land\u0131r\u0131lm\u0131\u015f bir web sunucusu veya web uygulamas\u0131n\u0131n, ger\u00e7ek IP adresiniz veya anonimli\u011finizi azaltabilecek veya bir hacker'a yard\u0131mc\u0131 olabilecek sunucu ayr\u0131nt\u0131lar\u0131 gibi bilgileri s\u0131zd\u0131rabilece\u011fini unutmay\u0131n. Alternatif bir platform kullan\u0131yorsan\u0131z, \u00e7evrimi\u00e7i koymadan \u00f6nce g\u00fcvence alt\u0131na ald\u0131\u011f\u0131n\u0131zdan emin olun. \u015e\u00fcpheniz varsa, web sunucusu ve Web Uygulamas\u0131 Sertle\u015fmesi hakk\u0131nda \u00e7evrimi\u00e7i k\u0131lavuzlara dan\u0131\u015f\u0131n: \u00d6rne\u011fin:";
