    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Bu ayar, ge\u00e7erli bir engelleme listesi dosyas\u0131na i\u015faret eden bir yol ile yap\u0131land\u0131r\u0131ld\u0131\u011f\u0131nda, kullan\u0131c\u0131 yap\u0131land\u0131rmal\u0131 ek bir engelleme listesinin y\u00f6nlendirici ba\u015flat\u0131ld\u0131\u011f\u0131nda y\u00fcklenmesini sa\u011flar. [Varsay\u0131lan olarak devre d\u0131\u015f\u0131 b\u0131rak\u0131ld\u0131, yeniden ba\u015flatma gereklidir]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+, konsol, t\u00fcnel y\u00f6neticisi, I2PSnark, SusiDNS ve Susimail i\u00e7in \u00f6zel tema ge\u00e7ersiz k\u0131lma deste\u011fi sa\u011flar, b\u00f6ylece temalar\u0131 y\u00fckseltmelerden sonra kal\u0131c\u0131 olarak de\u011fi\u015ftirebilirsiniz. Bir ge\u00e7ersiz k\u0131lma etkinle\u015ftirmek i\u00e7in, temay\u0131 de\u011fi\u015ftirmek istedi\u011finiz teman\u0131n ilgili temadizini i\u00e7inde teman\u0131z\u0131 de\u011fi\u015ftirerek ve <code>override.css</code> ad\u0131nda bir css dosyas\u0131 olu\u015fturun veya \u00f6rnek dosyalardan birini yeniden adland\u0131r\u0131n ve ard\u0131ndan taray\u0131c\u0131y\u0131 temizleyin. T\u00fcnel y\u00f6neticisi ve konsol ayn\u0131 override.css'yi kullan\u0131r. Bir ge\u00e7ersiz k\u0131lmay\u0131 etkisiz hale getirmek i\u00e7in <code>override.css</code> dosyas\u0131n\u0131 silin veya yeniden adland\u0131r\u0131n ve ard\u0131ndan taray\u0131c\u0131y\u0131 temizleyin (genellikle Control + Shift + R).";
