    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "True olarak ayarland\u0131\u011f\u0131nda, bu ayar, bir e\u015fin \u00fclke bayra\u011f\u0131 g\u00f6r\u00fcnt\u00fclendi\u011finde veya bir e\u015fin host ad\u0131 veya alan ad\u0131 a\u00e7\u0131k\u00e7a konsolda g\u00f6r\u00fcnt\u00fclenirken veya e\u015fin RouterInfo'si diske yaz\u0131ld\u0131\u011f\u0131nda tetiklenen ters DNS aramalar\u0131n\u0131 etkinle\u015ftirir. Yinelemelerden ka\u00e7\u0131nmak i\u00e7in, 10 dakika veya daha fazla i\u00e7in DNS aramalar\u0131 i\u00e7in c\u00f6mert bir \u00f6nbellekleme politikas\u0131 yap\u0131land\u0131rman\u0131z ve i\u015fletim sisteminizde gizlili\u011fi sayg\u0131layan bir DNS sunucusu yap\u0131land\u0131rman\u0131z \u00f6nerilir. [Varsay\u0131lan olarak devre d\u0131\u015f\u0131 b\u0131rak\u0131ld\u0131, yeniden ba\u015flatma gerektirir]";
