    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "E\u015f zamanl\u0131 kullan\u0131c\u0131 say\u0131s\u0131n\u0131 y\u00f6neten bir dinamik bir site \u00e7al\u0131\u015ft\u0131r\u0131yorsan\u0131z, i\u00e7erik \u00f6nbelleklendirme genellikle sayfalar\u0131n teslim s\u00fcresini iyile\u015ftirebilir. H\u0131zla de\u011fi\u015fen i\u00e7erikler i\u00e7in, <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>mikro-\u00f6nbellekleme stratejisi</a> hala baz\u0131 avantajlar sa\u011flayabilir. <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx web sunucusu</a> yetenekli bir \u00f6nbellek alt sistemi sa\u011flar veya daha a\u011f\u0131r bir \u00e7\u00f6z\u00fcm i\u00e7in <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>'a g\u00f6z atabilirsiniz.";
