    t[5503] = "BOB";
    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Birka\u00e7 dakikal\u0131k \u00e7al\u0131\u015fma s\u00fcresinden sonra y\u00f6nelticinizin 0 Etkin E\u015f ve 0 Bilinen E\u015f g\u00f6sterdi\u011fi, kenar \u00e7ubu\u011funda a\u011f ba\u011flant\u0131n\u0131z\u0131 kontrol etmeniz gerekti\u011fine dair bir bildirimle kar\u015f\u0131la\u015f\u0131rsan\u0131z, internete eri\u015fim sa\u011flayabildi\u011finizi do\u011frulay\u0131n. \u0130nternet ba\u011flant\u0131n\u0131z d\u00fczg\u00fcn \u00e7al\u0131\u015f\u0131yorsa, g\u00fcvenlik duvar\u0131n\u0131zda Java'y\u0131 engellemi\u015f olabilirsiniz. Aksi takdirde, I2P y\u00f6nlendiricinizi yeniden a\u015f\u0131laman\u0131z gerekebilir. <a href=/configreseed#reseedconfig>Yeniden a\u015f\u0131lama yap\u0131land\u0131rma sayfas\u0131n\u0131</a> ziyaret edin ve <i>De\u011fi\u015fiklikleri Kaydet ve \u015eimdi Yeniden A\u015f\u0131lama Yap</i> d\u00fc\u011fmesini t\u0131klay\u0131n. Daha fazla bilgi i\u00e7in yukar\u0131daki <a href=#reseedhelp>Yeniden a\u015f\u0131lama yard\u0131m b\u00f6l\u00fcm\u00fcne</a> bak\u0131n.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "M\u00fc\u015fteriler i\u00e7in daha y\u00fcksek d\u00fczeyli bir soket API'si. Yaln\u0131zca bir SAM V3 m\u00fc\u015fterisi UDP oturumu istedi\u011finde a\u00e7\u0131l\u0131r. <a href=/configclients> M\u00fc\u015fteri Yap\u0131land\u0131rma sayfas\u0131nda</a> etkinle\u015ftirilebilir / devre d\u0131\u015f\u0131 b\u0131rak\u0131labilir. <code>clients.config</code> dosyas\u0131nda SAM komut sat\u0131r\u0131 se\u00e7ene\u011fi <code>sam.udp.port=nnnn</code> ile de\u011fi\u015ftirilebilir.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "E\u011fer sitenizin h\u0131zl\u0131 tepki vermesini istiyorsan\u0131z, b\u00fcy\u00fck resimleri bar\u0131nd\u0131r\u0131rken g\u00f6r\u00fcnt\u00fc s\u0131k\u0131\u015ft\u0131rmas\u0131 \u00f6nemlidir. Png ve jpeg resimlerinizi s\u0131k\u0131\u015ft\u0131rmak i\u00e7in <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> gibi bir hizmet kullanmak genellikle daha k\u00fc\u00e7\u00fck dosyalar\u0131 minimal kalite kayb\u0131yla elde etmenizi sa\u011flar. Baz\u0131 durumlarda jepgresin yerine webp format\u0131 daha iyi sonu\u00e7 verebilir, yakla\u015f\u0131k olarak ayn\u0131 veya daha iyi g\u00f6rsel kaliteye sahip daha k\u00fc\u00e7\u00fck dosyalar \u00fcretebilir ve geni\u015f taray\u0131c\u0131 deste\u011fi bulunmaktad\u0131r. Ayr\u0131ca simgeler ve ill\u00fcstrasyonlar i\u00e7in bitmap yerine svg kullanmay\u0131 d\u00fc\u015f\u00fcn\u00fcn - genellikle e\u015fde\u011fer bitmap dosyas\u0131ndan daha k\u00fc\u00e7\u00fckt\u00fcrler (gereksiz art\u0131klar\u0131 kald\u0131ran <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> gibi bir hizmetten ge\u00e7irin), kalite kayb\u0131 olmadan \u00f6l\u00e7eklendirilebilirler ve web sunucusunuz taraf\u0131ndan s\u0131k\u0131\u015ft\u0131r\u0131labilirler";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "Ayg\u0131t \u00fczerinde UPnP \u00f6zelli\u011fi devre d\u0131\u015f\u0131 b\u0131rak\u0131lm\u0131\u015f oldu\u011fundan";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Varsay\u0131lan olarak, \u00e7o\u011fu istemci hizmetiniz (posta, http vekili, IRC) ayn\u0131 t\u00fcneller k\u00fcmesini (performans nedenleriyle) payla\u015facak ve Yan \u00c7ubuk'ta Hizmet T\u00fcnelleri alt\u0131nda <i>Payla\u015f\u0131lan \u0130stemciler</i> ve <i>Payla\u015f\u0131lan \u0130stemciler (DSA)</i> olarak listelenecektir ve <a href=/tunnels>T\u00fcneller sayfas\u0131nda</a> yer alacak.";
