    t[5681] = "I2P sistem hizmetini yap\u0131land\u0131r\u0131n";
    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "Bu kap\u0131 numaras\u0131n\u0131n ba\u015fka bir uygulama taraf\u0131ndan kullan\u0131lmad\u0131\u011f\u0131na emin olun. Kullan\u0131l\u0131yorsa, bu uygulamay\u0131 durdurun ya da I2P kap\u0131 numaras\u0131n\u0131 de\u011fi\u015ftirin.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "E\u015fleri manuel olarak d\u00fczenleyin ve yasakl\u0131 e\u015fleri ve engellenenler listesini g\u00f6r\u00fcnt\u00fcleyin";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Gelen TCP Etkinle\u015ftirilmi\u015f G\u00fcvenlik Duvar\u0131";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Daha iyi ba\u011flant\u0131 i\u00e7in modeminizde, y\u00f6nlendiricinizde ve/veya g\u00fcvenlik duvar\u0131n\u0131zda <a href=/confignet#udpconfig>I2P+'n\u0131n portunu</a> a\u00e7\u0131n (ideal olarak hem UDP hem de TCP). Port y\u00f6nlendirmenin nas\u0131l yap\u0131laca\u011f\u0131 hakk\u0131nda daha fazla bilgi <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, forumlar\u0131m\u0131z ve a\u015fa\u011f\u0131da listelenen IRC kanallar\u0131nda bulunabilir. I2P, internete http veya socks proxy \u00fczerinden ba\u011flanmay\u0131 desteklemez [yamalar bekliyoruz!], ancak a\u011fa ba\u011fland\u0131ktan sonra I2P \u00fczerinden proxy'lere ba\u011flanabilirsiniz.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "T\u00fcnel filtresi, t\u00fcnel k\u0131s\u0131tlay\u0131c\u0131 veya alternatif bir strateji ile birlikte ger\u00e7ek kullan\u0131c\u0131lar i\u00e7in hizmeti kesintiye u\u011fratmadan reddetme sald\u0131r\u0131lar\u0131na kar\u015f\u0131 koruma sa\u011flayabilir. Ayr\u0131ca, sunucunun sald\u0131r\u0131 alt\u0131nda olup olmad\u0131\u011f\u0131n\u0131 belirlemek veya sadece t\u00fcm ziyaret\u00e7ileri I2P hedefiyle birlikte kaydetmek i\u00e7in bar\u0131nd\u0131r\u0131lan hizmete eri\u015fimi kaydetmek i\u00e7in de kullan\u0131labilir. Ayr\u0131ca, bir filtre, T\u00fcnel Y\u00f6neticisi'nin eri\u015fim listesi denetimlerinden daha esnek olmas\u0131n\u0131 sa\u011flamak i\u00e7in birlikte bir beyaz liste ve kara liste olarak \u00e7al\u0131\u015fabilir. E\u011fer k\u00fcresel bir filtre uygulamak isterseniz, birden fazla sunucu t\u00fcneli tek bir filtre dosyas\u0131n\u0131 payla\u015fabilir.";
