    t[6021] = "UDP Devre D\u0131\u015f\u0131 B\u0131rak\u0131lm\u0131\u015f G\u00fcvenlik Duvar\u0131";
    t[6024] = "Landing page for various services";
    t[6025] = "\u00c7e\u015fitli hizmetler i\u00e7in a\u00e7\u0131l\u0131\u015f sayfas\u0131";
    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Bu ayar (milisaniye cinsinden) Yenileme Router'lar \u0130\u015f taraf\u0131ndan \u00e7al\u0131\u015ft\u0131r\u0131lan g\u00fcncelleme g\u00fcncellenmesi aras\u0131ndaki gecikmeyi elle yap\u0131land\u0131rman\u0131za olanak tan\u0131r. Varsay\u0131lan olarak, yenileme aras\u0131ndaki ara NetDb'nin boyutuna ba\u011fl\u0131 olarak belirlenir ve trafi\u011fi azaltmak i\u00e7in zamanlamada rastgelelik tan\u0131t\u0131r. 2000 milisaniyeden daha d\u00fc\u015f\u00fck de\u011ferler i\u00e7in, <code>router.refreshTimeout</code> de\u011ferini art\u0131rman\u0131z \u00f6nerilir. Bu de\u011feri 2000 milisaniyenin alt\u0131na ayarlaman\u0131z, a\u011f trafi\u011finizi art\u0131racak ve i\u015f gecikmesine neden olabilir ve s\u00fcrekli kullan\u0131m i\u00e7in \u00f6nerilmez.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Sunucu t\u00fcnelleri, <a href=/i2ptunnelmgr>T\u00fcneller Y\u00f6neticisi</a> nde yap\u0131land\u0131r\u0131labilen bir dizi y\u00f6ntem sunarak hizmetin eri\u015fimini s\u0131n\u0131rlamaya yard\u0131mc\u0131 olur. \u00c7e\u015fitli hizmetler i\u00e7in olumsuz etki yaratabilen sald\u0131r\u0131 urleri, bant geni\u015fli\u011fi a\u015f\u0131m\u0131, sald\u0131r\u0131 urleri, ve t\u00fcnel filtrelemesi y\u00f6ntemlerinin kullan\u0131lmas\u0131 ile tahsis edilen yol k\u0131s\u0131tlamalar\u0131, bilinen I2P hedeflerine \u00f6zel eri\u015fimi m\u00fcmk\u00fcn k\u0131labilirken sunucuya trafik y\u00f6netebilir.";
