    t[6205] = "Bile\u015fik bant geni\u015fli\u011fi \u00e7izelgesi";
    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Bu dosyay\u0131 bilinmeyen kullan\u0131c\u0131lara a\u00e7\u0131klamay\u0131n, \u00e7\u00fcnk\u00fc kendi I2P y\u00f6nlendiricinizden (100 RouterInfo dosyas\u0131) hassas veri i\u00e7erir ve bu veriler d\u00fc\u015fman taraf\u0131ndan kimli\u011finizi gizlemek i\u00e7in potansiyel olarak kullan\u0131labilir. Anonimli\u011finizi korumak i\u00e7in: g\u00fcvenilir arkada\u015f\u0131n\u0131zla dosyay\u0131 payla\u015fmadan \u00f6nce birka\u00e7 saat / g\u00fcn beklemelisiniz. Ayr\u0131ca bu prosed\u00fcr\u00fc az kullanman\u0131z \u00f6nerilir (haftada bir kezden fazla de\u011fil).";
