    t[6233] = "Yap\u0131land\u0131r";
    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "Ba\u015fka y\u00f6nlendiricilerin, t\u00fcnel zincirinde kendi y\u00f6nlendiricinizi kullanarak t\u00fcnel olu\u015fturmas\u0131na izin vererek a\u011fa katk\u0131da bulunma eylemi. Kat\u0131l\u0131m\u0131 etkinle\u015ftirmek i\u00e7in en az 12 KB/s yukar\u0131 do\u011fru bant geni\u015fli\u011fi (a\u011f payla\u015f\u0131m\u0131) ayr\u0131lmas\u0131 gerekmektedir. G\u00fcvenlik duvar\u0131 olan y\u00f6nlendiricilerin kat\u0131l\u0131ma ne kadar katk\u0131da bulunabilece\u011fi s\u0131n\u0131rl\u0131 olacak ve Gizli olarak belirlenmi\u015f bir y\u00f6nlendirici hi\u00e7bir \u015fekilde kat\u0131lmayacakt\u0131r.";
