    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "Bu ayar, Peer Exploration Job \u00e7al\u0131\u015f\u0131rken e\u015fzamanl\u0131 olarak ke\u015ffetmek i\u00e7in ka\u00e7 e\u015f aranaca\u011f\u0131n\u0131 belirler [varsay\u0131lan de\u011fer 3000'den fazla e\u015f oldu\u011funda, bir seferde 1 e\u015f]. Bu de\u011feri art\u0131rman\u0131n, ke\u015fif i\u00e7in bant geni\u015fli\u011fi gereksinimlerini art\u0131raca\u011f\u0131n\u0131 ve bu de\u011feri \u00e7ok y\u00fcksek ayarlaman\u0131n a\u015f\u0131r\u0131 mesaj gecikmesine ve di\u011fer hizmetlere m\u00fcdahaleye neden olabilece\u011fini unutmay\u0131n, bu nedenle dikkatli kullan\u0131n!";
