    t[6694] = "This setting, when set to true, will display a Peer Test Average readout in the Congestion section of the sidebar, calculated by adding the successful peer test average and the average excess time taken by failed tests. The average value may be used as a guide to determine the optimal <code>router.peerTestTimeout</code> value. [Default is false]";
    t[6695] = "Bu ayar, true olarak ayarland\u0131\u011f\u0131nda, ba\u015far\u0131l\u0131 akran testi ortalamas\u0131 ile ba\u015far\u0131s\u0131z testlerin ortalama fazla zaman almas\u0131n\u0131n birle\u015fiminden hesaplanan bir Peer Test Ortalama okumas\u0131n\u0131 kenar \u00e7ubu\u011funun T\u0131kan\u0131kl\u0131k b\u00f6l\u00fcm\u00fcnde g\u00f6sterecektir. Ortalama de\u011fer, optimal <code>router.peerTestTimeout</code> de\u011ferini belirlemek i\u00e7in bir rehber olarak kullan\u0131labilir. [Varsay\u0131lan de\u011fer false]";
