    t[6942] = "High capacity";
    t[6943] = "Y\u00fcksek kapasiteli";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Bir I2P eklentisi olarak mevcut olan Tor istemci birjava uygulamas\u0131d\u0131r. \u0130lgili SOCKS veya HTTP m\u00fc\u015fteri t\u00fcneli yoluyla yap\u0131land\u0131r\u0131ld\u0131\u011f\u0131nda varsay\u0131lan <i>outproxy</i> olarak kullan\u0131labilir. <i>Tunnel Manager</i>. <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>'dan indirilebilir. Kaynak kodu <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>'da mevcuttur.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "IPv4 Adresleri";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Bu b\u00f6l\u00fcm, oturumunuz i\u00e7in ortalama bant geni\u015fli\u011fi h\u0131zlar\u0131n\u0131 ve toplam kullan\u0131m\u0131n\u0131z\u0131 g\u00f6sterir. T\u00fcm de\u011ferler saniye ba\u015f\u0131na bayt cinsinden verilmi\u015ftir. Bant geni\u015fli\u011fi s\u0131n\u0131rlar\u0131n\u0131z\u0131 <a href='/config'>Bant Geni\u015fli\u011fi Yap\u0131land\u0131rma sayfas\u0131ndan</a> de\u011fi\u015ftirebilirsiniz. Daha fazla bant geni\u015fli\u011fi sunarsan\u0131z, a\u011fa daha fazla yard\u0131mc\u0131 olur ve kendi anonimli\u011finizi art\u0131r\u0131rs\u0131n\u0131z, bu nedenle l\u00fctfen ayarlar\u0131 g\u00f6zden ge\u00e7irmek i\u00e7in zaman ay\u0131r\u0131n. A\u011f\u0131n\u0131z\u0131n h\u0131z\u0131ndan emin de\u011filseniz, <a href='http://speedtest.net/'>SpeedTest</a> veya benzeri bir servis kullanmak, bant geni\u015fli\u011fi kapasiteniz hakk\u0131nda iyi bir fikir verir. Y\u00fckleme payla\u015f\u0131m miktar\u0131n\u0131z (KB/s \u00c7\u0131k\u0131\u015f), toplam katk\u0131n\u0131z\u0131 belirleyecektir. Bant geni\u015fli\u011fi varsay\u0131lan olarak <a href='/graphs'>grafikle</a> g\u00f6sterilir.";
