    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Bu ayar, router'\u0131n beklenen bant geni\u015fli\u011fi gereksinimlerine g\u00f6re t\u00fcnel isteklerini reddetmeye ba\u015flamadan \u00f6nce bar\u0131nd\u0131r\u0131lan kat\u0131l\u0131mc\u0131 t\u00fcnellerin minimum say\u0131s\u0131n\u0131 yap\u0131land\u0131rman\u0131za olanak tan\u0131r. [Varsay\u0131lan olarak, sistem Android \u00fczerinde \u00e7al\u0131\u015f\u0131yorsa 100, sistem ARM \u00fczerinde \u00e7al\u0131\u015f\u0131yor ve 4'ten az \u00e7ekirdek varsa 800, sistem ARM \u00fczerinde \u00e7al\u0131\u015f\u0131yor ve 4 veya daha fazla \u00e7ekirdek varsa 1200, aksi durumda 2500]";
