    t[7150] = "Critical error";
    t[7151] = "Kritik hata";
    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P bu t\u00fcrde bir g\u00fcvenlik duvar\u0131n\u0131n arkas\u0131nda iyi \u00e7al\u0131\u015fmaz. B\u00fcy\u00fck olas\u0131l\u0131kla geli\u015f ba\u011flant\u0131lar\u0131n\u0131 kabul edemeyeceksiniz ve bu durum a\u011fa kat\u0131l\u0131m\u0131n\u0131z\u0131 s\u0131n\u0131rlayacak.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "I2P \u0130stemci Protokol\u00fc (I2CP), d\u0131\u015f uygulamalar\u0131n (istemcilerin) I2P ile tek bir TCP soketi \u00fczerinden ileti\u015fim kurmas\u0131n\u0131 sa\u011flar ve varsay\u0131lan olarak 7654 numaral\u0131 ba\u011flant\u0131 noktas\u0131n\u0131 kullan\u0131r. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelere</a> bak\u0131n.";
    t[7168] = "Queue Totals";
    t[7169] = "S\u0131ra Toplamlar\u0131";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Bu ayar, di\u011fer \u00f6\u011felerle ileti\u015fim kurarken hangi iletimin \u00f6nceli\u011fi oldu\u011funu belirler. Varsay\u0131lan olarak, UDP (SSU)'dan daha tercih edilen NTCP'dir. De\u011ferini true olarak ayarlarsan\u0131z, var olan bir NTCP ba\u011flant\u0131s\u0131 olmad\u0131k\u00e7a UDP tercih edilecektir; her zaman olarak ayarland\u0131\u011f\u0131nda, mevcut NTCP ba\u011flant\u0131s\u0131na bak\u0131lmaks\u0131z\u0131n her zaman UDP kullan\u0131lacakt\u0131r. [Varsay\u0131lan de\u011fer false'dir]";
    t[7174] = "Translation Status";
    t[7175] = "\u00c7eviri Durumu";
