    t[7195] = "Geli\u015f TCP ba\u011flant\u0131s\u0131 i\u00e7in A\u011f Yap\u0131land\u0131rmas\u0131 b\u00f6l\u00fcm\u00fcnde bir sunucu ad\u0131 ve kap\u0131 numaras\u0131 belirtilmemi\u015f. Bununla birlikte UDP ba\u011flant\u0131s\u0131 devre d\u0131\u015f\u0131 b\u0131rak\u0131lm\u0131\u015f.";
    t[7200] = "Certificates are used to authenticate encrypted services running on the network, provision optional SSL for hosted services and the router console, or provide proof of ownership of a router family.";
