    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Do\u011fru olarak ayarland\u0131\u011f\u0131nda, I2P a\u011f ba\u011flant\u0131s\u0131 olmadan \u00e7al\u0131\u015f\u0131r; bu, a\u011f kesintisini \u00f6nleyece\u011fi i\u00e7in kod g\u00fcncellemelerini test etmek i\u00e7in y\u00f6nlendiriciyi s\u00fcrekli yeniden ba\u015flat\u0131yorsan\u0131z yararl\u0131 olur.";
    t[7302] = "Updating IP address";
    t[7303] = "IP adresi g\u00fcncelleniyor";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "Yaln\u0131z IPv6 SSU, rehberler";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (G\u00fcvenli Yar\u0131-G\u00fcvenilir UDP), IP adresi alg\u0131lama ve NAT a\u015fma hizmetlerine ek olarak, \u015fifreli, ba\u011flant\u0131 odakl\u0131, noktadan noktaya ba\u011flant\u0131lar sa\u011flayan bir I2P a\u011f ta\u015f\u0131mac\u0131l\u0131\u011f\u0131d\u0131r. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelere</a> bak\u0131n.";
    t[7314] = "Congestion window";
    t[7315] = "T\u0131kan\u0131kl\u0131k penceresi";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Yeniden Da\u011f\u0131t\u0131m i\u00e7in Proxy Kullan\u0131n";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "I2P entegrasyonunun <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>'de ger\u00e7ekle\u015fmesinden \u00f6nce, I2P a\u011f\u0131 \u00fczerinde bar\u0131nd\u0131r\u0131lmayan torrentleri indirmek m\u00fcmk\u00fcn de\u011fildi. Ancak, \u015fimdi Vuze (ve daha sonra <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) I2P'de I2P d\u0131\u015f\u0131 torrentleri payla\u015fabilme olana\u011f\u0131 sunuyor, b\u00f6ylece Vuze/Bigly kullan\u0131c\u0131lar\u0131 I2P a\u011f\u0131na i\u00e7eri\u011fi kullan\u0131ma sunmaya karar verdiklerinde I2P \u00fczerinden I2P d\u0131\u015f\u0131 torrentler indirilebilir. Bir\u00e7ok e\u015fe sahip pop\u00fcler torrentlerin I2P \u00fczerinden eri\u015filebilir olma olas\u0131l\u0131\u011f\u0131 daha y\u00fcksektir. \u0130\u00e7eri\u011fin kullan\u0131mda olup olmad\u0131\u011f\u0131n\u0131 belirlemek i\u00e7in torrent ba\u011flant\u0131s\u0131n\u0131, m\u0131knat\u0131s ba\u011flant\u0131s\u0131n\u0131 veya infohash'i I2P destekli BitTorrent istemcinize ekleyin.";
