    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "Bu ayar (saat cinsinden) NetDb'deki bir RouterInfo'nun (son bilinen yay\u0131n tarihi) eskimi\u015f ve silinmi\u015f olarak s\u0131n\u0131fland\u0131r\u0131lmadan \u00f6nce ne kadar eski olmas\u0131 gerekti\u011fini belirler. [Varsay\u0131lan de\u011fer 28 saat, ancak rot\u00f6r bir Floodfill ise varsay\u0131lan de\u011feri 8 saattir]";
