    t[7442] = "Router Help and FAQ";
    t[7443] = "Y\u00f6neltici Yard\u0131m\u0131 ve SSS";
    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "E\u011fer bir <i>Kay\u0131t Yetkilendirme</i> dizesi istenirse, onu <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Kay\u0131t Yetkilendirme sayfas\u0131</a>'nda bulabilirsiniz. Bu sayfaya <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>T\u00fcnel Y\u00f6neticisi Yap\u0131land\u0131rma sayfas\u0131</a>'ndan ula\u015fabilirsiniz. Kay\u0131t yetkilendirmesi, sadece sahibin alan ad\u0131n\u0131 kaydetme veya y\u00f6netme yetene\u011fine sahip olmas\u0131n\u0131 sa\u011flar ve stats.i2p ve reg.i2p \u00fczerinde gereklidir.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Haberler ve G\u00fcncellemeler";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Router'\u0131 <code>i2p/i2prouter start</code> ile ba\u015flatam\u0131yorsan\u0131z, ayn\u0131 dizindeki <code>runplain.sh</code> beti\u011fini deneyin. I2P+ \u00e7al\u0131\u015ft\u0131rmak i\u00e7in asla k\u00f6k ayr\u0131cal\u0131\u011f\u0131 gerekmektedir. Nadir durumlarda gereken <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi k\u00fct\u00fcphanesi</a>'ni derlemeniz gerekiyorsa, belgelere ba\u015fvurun, forumlar\u0131 ziyaret edin veya <a href=irc://127.0.0.1:6668/saltR class=chatlink>I2P+ kanal\u0131na</a> veya <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC geli\u015ftirici kanal\u0131na</a> gidin.";
    t[7454] = "Top 50 peers by transit tunnel requests";
    t[7455] = "Transit t\u00fcnel isteklerine g\u00f6re ilk 50 e\u015f";
    t[7458] = "Information defining the unique identity of a router on the network which includes its IP address (or the IP addresses of intermediate introducers) and listening port, public signing and encryption keys. Router identities correlate to peers in the NetDB. Also referred to as a <i>RouterInfo</i>.";
    t[7459] = "Y\u00f6nlendiricinin benzersiz kimli\u011fini tan\u0131mlayan bilgilerdir. Bu bilgiler, IP adresini (veya ara tan\u0131t\u0131c\u0131lar\u0131n IP adreslerini) ve dinlenen portu, genel imzalama ve \u015fifreleme anahtarlar\u0131n\u0131 i\u00e7erir. Y\u00f6nlendirici kimlikleri, NetDB'deki arkada\u015flara uyumlu hale getirilir. Ayr\u0131ca bir <i>RouterInfo</i> olarak da adland\u0131r\u0131l\u0131r.";
