    t[7682] = "Destination";
    t[7683] = "Hedef";
    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Y\u00f6nlendirici ileti\u015fim bilgileri (RouterInfos) ve hedef ileti\u015fim bilgileri (LeaseSets) i\u00e7eren da\u011f\u0131t\u0131lm\u0131\u015f bir veritaban\u0131d\u0131r. Tek bir y\u00f6nlendirici, a\u011fdaki di\u011fer y\u00f6nlendiricilerle ileti\u015fim kurmak i\u00e7in kendine ait (k\u0131smi) bir veritaban\u0131n\u0131 tutar; tek bir y\u00f6nlendirici t\u00fcm y\u00f6nlendiricilerin listesini tutmaz. RouterInfos diskte depolan\u0131r ve y\u00f6nlendirici ba\u015flad\u0131\u011f\u0131nda veya yeni RouterInfos al\u0131nd\u0131\u011f\u0131nda belle\u011fe y\u00fcklenir. Ayr\u0131ca <i>NetDb</i> olarak da adland\u0131r\u0131l\u0131r. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelere</a> bak\u0131n.";
