    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "Ayn\u0131 anda \u00e7al\u0131\u015ft\u0131r\u0131labilen maksimum e\u015f zamanl\u0131 <a href=/jobs>g\u00f6rev</a> say\u0131s\u0131n\u0131 tan\u0131mlar. Varsay\u0131lan de\u011fer, <code>wrapper.config</code> arac\u0131l\u0131\u011f\u0131yla JVM'ye ayr\u0131lan bellek miktar\u0131na ba\u011fl\u0131 olarak belirlenir ve 64MB'den daha az i\u00e7in 3'e, 256M'den daha az i\u00e7in 4'e veya 256MB'den daha fazla i\u00e7in 5'e ayarlan\u0131r. Not: Bu ayar\u0131n de\u011fi\u015ftirilmesi, y\u00f6nlendiricinin yeniden ba\u015flat\u0131lmas\u0131n\u0131 gerektirir.";
