    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Bir a\u011f \u00fczerinde, di\u011fer y\u00f6nlendiriciler ve a\u011fdaki di\u011fer hizmetler hakk\u0131nda bilgi sa\u011flamak ve almakla g\u00f6revli olan bir y\u00f6nlendirici. Bir y\u00f6nlendiricinin floodfill g\u00f6revlerini ger\u00e7ekle\u015ftirebilecek kapasitede kabul edilebilmesi i\u00e7in mevcut minimum payla\u015f\u0131ml\u0131 bant geni\u015fli\u011fi 128 Kbayt/sn'dir, ancak bu gereksinimi ge\u00e7ersiz k\u0131lmak ve bir y\u00f6nlendiriciyi floodfill olarak zorlamak m\u00fcmk\u00fcnd\u00fcr <a href=/configadvanced>Geli\u015fmi\u015f Yap\u0131land\u0131rma</a> sayfas\u0131nda. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelere</a> bak\u0131n.";
