    t[8237] = "Ba\u015flat";
    t[8240] = "Hide legend";
    t[8241] = "\u0130\u015faretleri gizle";
    t[8244] = "Details";
    t[8245] = "Ayr\u0131nt\u0131lar";
    t[8252] = "Help Section";
    t[8253] = "Yard\u0131m B\u00f6l\u00fcm\u00fc";
    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "I2P+ yap\u0131land\u0131rma: A\u011f, Firefox, T\u00fcnel Y\u00f6neticisi";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "G\u00fcvenlik duvar\u0131n\u0131z\u0131 a\u00e7t\u0131\u011f\u0131n\u0131z halde I2P hala ba\u011flant\u0131n\u0131n g\u00fcvenlik duvarl\u0131 oldu\u011funu d\u00fc\u015f\u00fcn\u00fcyorsa birden \u00e7ok g\u00fcvenlik duvar\u0131 olabilece\u011fini unutmay\u0131n. Yaz\u0131l\u0131msal ve y\u00f6neltici ya da \u0130nternet ba\u011flant\u0131s\u0131n\u0131 sa\u011flayan donan\u0131mlar \u00fczerinde bulunanlar gibi.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "Anahtar kelime <i class=example>deny</i>. Bu e\u015fik her zaman ihlal edilir, yani hi\u00e7bir ba\u011flant\u0131 denemesine izin verilmez.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "dakikada 90 veya daha fazla ba\u011flant\u0131 yapan ziyaret\u00e7ileri kaydet";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Geli\u015f TCP ba\u011flant\u0131s\u0131 etkinle\u015ftirilmi\u015f bununla birlikte UDP kap\u0131 numaran\u0131z g\u00fcvenlik duvar\u0131 taraf\u0131ndan engelleniyor ve bu nedenle TCP kap\u0131 numaran\u0131z da g\u00fcvenlik duvar\u0131 taraf\u0131ndan engelleniyor.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Bu, y\u00f6nlendiricinizin a\u011f veritaban\u0131 sorgular\u0131nda kullanaca\u011f\u0131 e\u015f say\u0131s\u0131d\u0131r. Bunlar genellikle a\u011f b\u00fct\u00fcnl\u00fc\u011f\u00fcn\u00fc korumaktan sorumlu olan <i>floodfill</i> y\u00f6nlendiricileridir. Uygun entegre edilmi\u015f e\u015fleriniz <a href='/profiles'>Profiller sayfas\u0131n\u0131n</a> alt\u0131nda g\u00f6sterilir. ";
    t[8298] = "Manage Router webapps";
    t[8299] = "Y\u00f6nlendirici web uygulamalar\u0131n\u0131 y\u00f6netin";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "Rastgele y\u00fcksek portlardan belirli olmayan uzak TCP portlar\u0131na \u00e7\u0131k\u0131\u015f yap\u0131l\u0131r.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "I2P uygulamas\u0131n\u0131 ba\u015flatt\u0131\u011f\u0131n\u0131zda y\u00f6nelticinizin ba\u015flat\u0131larak a\u011f ile b\u00fct\u00fcnle\u015fmesi ve di\u011fer e\u015fleri bulmas\u0131 bir ka\u00e7 dakika s\u00fcrebilir. L\u00fctfen sab\u0131rl\u0131 olun.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "Dosya belirtilmedi. ";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
    t[8321] = "Evrensel Tak-\u00e7al\u0131\u015ft\u0131r (UPnP) \u00f6zelli\u011fini etkinle\u015ftirin";
    t[8322] = "Unknown Wizard page";
    t[8323] = "Bilinmeyen Sihirbaz sayfas\u0131";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "Yaln\u0131z IPv6 NTCP, SSU, rehberler";
    t[8332] = "Messages sent to peer";
    t[8333] = "E\u015fe g\u00f6nderilen mesajlar";
    t[8334] = "Function";
    t[8335] = "\u0130\u015flev";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "I2P a\u011f\u0131nda, uzaktan bar\u0131nd\u0131r\u0131lan hizmetlere, \".b32.i2p\" ile biten bir <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> adresi, uzun bir <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> dizesi olarak temsil edilen bir <i>hedef</i>, veya daha yayg\u0131n olarak bir .i2p alan ad\u0131 kullan\u0131larak eri\u015filebilir. Bir hedef, I2P'nin bir IP adresine e\u015fde\u011feridir ve <a href='/i2ptunnel/edit?tunnel=3'>T\u00fcnel Y\u00f6neticisi Yap\u0131land\u0131rma sayfas\u0131nda</a> g\u00f6sterilir. Kendi .i2p alan ad\u0131n\u0131z\u0131 kaydettirmedi\u011finiz s\u00fcrece, b32.i2p adresinizi ba\u015fkalar\u0131n\u0131n web sitenize eri\u015fmesine izin vermek i\u00e7in payla\u015fabilirsiniz.";
    t[8340] = "Computing-related tutorials";
    t[8341] = "Bilgisayarla ilgili e\u011fitimler";
    t[8342] = "Error {0}";
    t[8343] = "Hata {0}";
    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "\u0130smi girip hedefi <a href='/dns?book=router&amp;filter=none'>adres defterinize</a> yap\u0131\u015ft\u0131r\u0131n. Yeni giri\u015fi kaydetmek i\u00e7in <i>Ekle</i> d\u00fc\u011fmesine t\u0131klay\u0131n.";
    t[8358] = "Stats";
    t[8359] = "\u0130statistikler";
    t[8360] = "Maximum number of concurrent messages to send";
    t[8361] = "G\u00f6nderilecek maksimum e\u015fzamanl\u0131 mesaj say\u0131s\u0131";
    t[8364] = "Recorders keep track of connection attempts made by a remote destination, and if that breaches the defined threshold, the destination gets logged in the specified file. Multiple recorders can be specified:";
    t[8365] = "Kaydediciler, bir uzak hedef taraf\u0131ndan yap\u0131lan ba\u011flant\u0131 giri\u015fimlerini izler ve bu, tan\u0131mlanan e\u015fi\u011fi ihlal ederse, hedef belirtilen dosyada kaydedilir. Birden fazla kaydedici belirtilebilir:";
    t[8368] = "(the symbol '@' will be replaced during log rotation)";
    t[8369] = "(g\u00fcnl\u00fck turu s\u0131ras\u0131nda '@' simgesi de\u011fi\u015ftirilecek)";
