    t[8408] = "Delete Sybil Blocklist";
    t[8409] = "Sybil Engelleme Listesini Sil";
    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Dizin listelerini devre d\u0131\u015f\u0131 b\u0131rakmak i\u00e7in, <code>eepsite/contexts</code> klas\u00f6r\u00fcndeki (<code>docroot</code> klas\u00f6r\u00fcnden hemen \u00f6nce) <code>base-context.xml</code> dosyas\u0131nda <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> giri\u015fini bulun ve hemen alt\u0131na 'true' yazan yeri 'false' olarak de\u011fi\u015ftirin. De\u011fi\u015fikli\u011fi hemen uygulamak i\u00e7in  <a href=/configclients>M\u00fc\u015fteri Yap\u0131land\u0131rma sayfas\u0131nda</a> <i>I2P Web Sunucusu</i> istemcisini durdurup yeniden ba\u015flat\u0131n. Ayr\u0131ca herhangi bir a\u00e7\u0131k dizine bo\u015f bir <code>index.html</code> dosyas\u0131 b\u0131rakarak o konumdaki dizin listelemelerini bast\u0131rabilirsiniz.";
