    t[8462] = "System Tray Integration";
    t[8463] = "Sistem Tepsisi Entegrasyonu";
    t[8466] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[8467] = "<code>clients.config</code> dosyas\u0131nda etkinle\u015ftirilebilir. Ayr\u0131ca belirli bir arabirimle veya t\u00fcm arabirimlerle ba\u011flant\u0131 kurmak i\u00e7in yap\u0131land\u0131r\u0131labilir. Hem http hem de https etkinse, otomatik y\u00f6nlendirme varsay\u0131lan olarak etkinle\u015ftirilir. Y\u00f6nlendirici Kontrol Panelini a\u011f \u00fczerinden kullan\u0131labilir hale getirirseniz, yetkisiz eri\u015fimi \u00f6nlemek i\u00e7in <a href=/configui#passwordheading>eri\u015fim \u015fifresi zorunlu tutabilirsiniz</a>.";
    t[8470] = "Show Legend";
