    t[8475] = "Profil";
    t[8490] = "A group of tunnel entry points (leases) for a <i>destination</i>. Note: A 0-hop server tunnel will only have one lease, regardless of the number of tunnels configured.";
    t[8491] = "Bir <i>hedef</i> i\u00e7in t\u00fcnel giri\u015f noktalar\u0131ndan (kiral\u0131k) olu\u015fan bir grup. Not: 0 atlay\u0131c\u0131l\u0131 sunucu t\u00fcneli, yap\u0131land\u0131r\u0131lan t\u00fcnellerin say\u0131s\u0131na bak\u0131lmaks\u0131z\u0131n yaln\u0131zca bir kira sahibi olacak.";
    t[8494] = "Tunnels";
