    t[8509] = "Hemen yeniden ba\u015flat";
    t[8516] = "Configure the status of the I2P service at system startup. If disabled, the service can be launched manually.";
    t[8517] = "I2P hizmetinin durumunu System Startup'ta yap\u0131land\u0131r\u0131n. Devre d\u0131\u015f\u0131 b\u0131rak\u0131l\u0131rsa, hizmet manuel olarak ba\u015flat\u0131labilir.";
    t[8524] = "torrents";
    t[8525] = "torrentler";
    t[8536] = "Job Queue";
    t[8537] = "\u0130\u015flem Kuyru\u011fu";
    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Internet Explorer kullanm\u0131yorsan\u0131z, web taray\u0131c\u0131n\u0131z IE gibi davran\u0131yor olabilir. Konsol temalar\u0131n\u0131 kullanabilmek i\u00e7in web taray\u0131c\u0131n\u0131z\u0131 (ya da vekil sunucuyu) farkl\u0131 bir User Agent dizgesi kullanacak \u015fekilde yap\u0131land\u0131r\u0131n.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "Gizlilik Odakl\u0131 Clearnet Arama Motoru";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Log'lar</a> bir sorunu \u00e7\u00f6zmenize yard\u0131mc\u0131 olabilir. Yard\u0131m i\u00e7in bir <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forumda</a> metinleri yap\u0131\u015ft\u0131rabilir veya belki de <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>yap\u0131\u015ft\u0131rabilir</a> ve IRC \u00fczerinden yard\u0131m i\u00e7in ba\u011flant\u0131ya at\u0131fta bulunabilirsiniz.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Geli\u015ftiricinin kriptografik anahtar\u0131yla imzalanm\u0131\u015f eklentiler \u00f6nerilen formatt\u0131r, ancak imzas\u0131z eklentiler (.zip) kurmak isterseniz bunu True olarak ayarlayabilirsiniz. Not: E\u011fer geli\u015ftirici, eklenti derleme i\u015flemi s\u0131ras\u0131nda ek denetimler eklediyse, h\u00e2l\u00e2 imzas\u0131z bir eklenti kurma denemesi yaparken sorunlarla kar\u015f\u0131la\u015fabilirsiniz.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Yerel olarak tek ba\u015f\u0131na bir Tor \u00f6rne\u011fi \u00e7al\u0131\u015ft\u0131r\u0131yorsan\u0131z, onu kullanabilirsiniz: I2P'yi kullanacak \u015fekilde yap\u0131land\u0131rarak <i>Proxy t\u00fcr\u00fc:</i> <code>SOCKS 5</code> <i>Ana bilgisayar:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Bu y\u00f6nlendirici konsolu ve web uygulamalar\u0131 (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrentlar</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>t\u00fcnel y\u00f6neticisi</a> vb.) i\u00e7in kullan\u0131lacak dili se\u00e7in. Dilinizi ileride de\u011fi\u015ftirmek, y\u00f6nlendirici konsolu temas\u0131n\u0131 de\u011fi\u015ftirmek veya konsola eri\u015fmek i\u00e7in bir \u015fifre yap\u0131land\u0131rmak isterseniz, bunu <a href=/configui target=_blank rel=noreferrer>Kullan\u0131c\u0131 Aray\u00fcz\u00fc yap\u0131land\u0131rma sayfas\u0131nda</a> yapabilirsiniz.";
