    t[9052] = "Ready";
    t[9053] = "Haz\u0131r";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Bunlar, y\u00f6nlendiriciniz taraf\u0131ndan sa\u011flanan yerel hizmetlerdir. \u01302PTunnel y\u00f6neticisi veya SAM, BOB veya do\u011frudan I2CP \u00fczerinden ba\u011flanan harici programlar arac\u0131l\u0131\u011f\u0131yla ba\u015flat\u0131lan istemci olabilirler. Varsay\u0131lan olarak, istemci hizmetlerinizin \u00e7o\u011fu (postalar, http proxy, IRC), ayn\u0131 set t\u00fcnelleri payla\u015facak \u015fekilde yap\u0131land\u0131r\u0131lm\u0131\u015flard\u0131r ve <i>Payla\u015f\u0131lan \u0130stemciler</i> ve <i>Payla\u015f\u0131lan \u0130stemciler(DSA)</i> olarak listelenirler, bu, t\u00fcm payla\u015f\u0131lan hizmetlerin trafi\u011fini kar\u0131\u015ft\u0131rarak anonimli\u011fi art\u0131r\u0131r ve t\u00fcnellerin olu\u015fturulmas\u0131 ve bak\u0131m\u0131 i\u00e7in gereken gereksinimleri azalt\u0131r. Bununla birlikte, bir t\u00fcnel hatas\u0131 ya\u015farsan\u0131z, t\u00fcm hizmetleriniz ayn\u0131 anda \u00e7evrimd\u0131\u015f\u0131 olur, bu nedenle baz\u0131 senaryolarda istemci hizmetlerini kendi t\u00fcnellerini kullanacak \u015fekilde yap\u0131land\u0131rmak isteyebilirsiniz. Bu, \u0130stemci Y\u00f6neticisi'ndeki ilgili istemci hizmetinin yap\u0131land\u0131rma sayfas\u0131nda, <i>Di\u011fer istemcilerle t\u00fcnelleri payla\u015f</i> se\u00e7ene\u011finin i\u015faretini kald\u0131rarak yap\u0131labilir, ard\u0131ndan istemci hizmetini <a href='/i2ptunnelmgr'>Ana T\u00fcnel Y\u00f6neticisi sayfas\u0131ndan</a> yeniden ba\u015flatman\u0131z gerekecektir.";
