    t[9138] = "If you'd like to report a bug, please file a ticket on <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. For developer-related discussions, please visit <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>zzz's developer forums</a> or come and visit the <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>developer channel</a> on I2P's IRC network.";
    t[9139] = "Bir hata bildirmek isterseniz, l\u00fctfen <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a> \u00fczerinde bir bildirim olu\u015fturun. Geli\u015ftirici ile ilgili tart\u0131\u015fmalar i\u00e7in l\u00fctfen <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>zzz'nin geli\u015ftirici forumlar\u0131na</a> gidin veya I2P'nin IRC a\u011f\u0131ndaki <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>geli\u015ftirici kanal\u0131na</a> ziyaret edin.";
