    t[9284] = "New override";
    t[9285] = "Yeni de\u011fi\u015fiklik";
    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Bu ayar (dakika cinsinden) ba\u015flang\u0131\u00e7tan sonra RouterInfos'nin ge\u00e7erlili\u011fi i\u00e7in NetDb'deki rotalar\u0131n ne kadar s\u00fcre beklemesinin manuel olarak yap\u0131land\u0131rman\u0131za olanak tan\u0131r, bu s\u00fcreden sonra sadece ge\u00e7erli rotalar dahil edilir. Do\u011frulama ger\u00e7ekle\u015fti\u011finde, ge\u00e7erlilik s\u00fcresi dolmu\u015f RouterInfos'lar ve yaln\u0131zca SSU \u00fczerinden eri\u015filebilen yan\u0131t vermeyen e\u015fler, NetDb'den kald\u0131r\u0131l\u0131r. [Varsay\u0131lan de\u011fer 60 dakika] Not: Bu ayar, NetDb depolamas\u0131 denendi\u011fi anda NetDb'den ve y\u00f6nlendirici oturumu i\u00e7in yasaklanan daha eski y\u00f6nlendiricilere (varsay\u0131lan olarak 0.9.29'dan daha eski) etkisi yoktur.";
