    t[9322] = "Configuration and bandwidth tester";
    t[9323] = "Yap\u0131land\u0131rma ve bant geni\u015fli\u011fi test cihaz\u0131";
    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "Y\u00f6nlendiricinin harici ba\u011flant\u0131 noktas\u0131 di\u011fer y\u00f6nlendiricilerle ileti\u015fim sa\u011flar. Y\u00f6nlendiricinizin a\u011fdaki performans\u0131n\u0131 optimize etmek i\u00e7in g\u00fcvenlik duvar\u0131n\u0131z\u0131 bu ba\u011flant\u0131 noktas\u0131nda gelen ve giden trafi\u011fe izin verecek \u015fekilde yap\u0131land\u0131rman\u0131z \u00f6nerilir.";
    t[9328] = "Bulk Thresholds";
    t[9329] = "Toplu E\u015fikler";
    t[9334] = "If the problem persists, verify that you have cookies enabled in your browser.";
    t[9335] = "Sorun s\u00fcrerse, taray\u0131c\u0131n\u0131zda \u00e7erezlerin etkinle\u015ftirilmi\u015f oldu\u011funa emin olun.";
    t[9350] = "Good Lookups";
    t[9351] = "\u0130yi Aramalar";
    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Reseeding, I2P'y\u0131 ilk kurdu\u011funuzda veya y\u00f6nlendiricinizde yeterli say\u0131da y\u00f6nlendirici referans\u0131 kalmad\u0131\u011f\u0131nda di\u011fer y\u00f6nlendiricileri bulmak i\u00e7in kullan\u0131lan ba\u015flatma s\u00fcrecidir. Varsay\u0131lan ayarlar \u00e7o\u011fu ki\u015fi i\u00e7in \u00e7al\u0131\u015facakt\u0131r. Bu ayarlar\u0131 yaln\u0131zca HTTPS'nin k\u0131s\u0131tlay\u0131c\u0131 bir g\u00fcvenlik duvar\u0131 taraf\u0131ndan engellendi\u011fi durumlarda ve yeniden tohumlama ba\u015far\u0131s\u0131z olduysa de\u011fi\u015ftirin.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
