    t[9467] = "Bu sorun ge\u00e7ici olabilir. Di\u011fer program art\u0131k bu kap\u0131 numaras\u0131n\u0131 kullanm\u0131yor olabilir.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "I2P+ y\u00f6nlendiriciniz varsay\u0131lan olarak, <i>kat\u0131l\u0131m</i> olarak bilinen di\u011fer y\u00f6nlendiriciler i\u00e7in dahili, u\u00e7tan uca \u015fifreli trafi\u011fi y\u00f6nlendirerek a\u011fa katk\u0131da bulunur. Bant geni\u015fli\u011fi kat\u0131l\u0131m\u0131, a\u011fdaki t\u00fcm kullan\u0131c\u0131lar\u0131n anonimlik seviyesini geli\u015ftirir ve indirme h\u0131z\u0131n\u0131z\u0131 en \u00fcst d\u00fczeye \u00e7\u0131kar\u0131r.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Bu ayar, y\u00f6nlendiricinizin do\u011fru saat dilimini korumas\u0131n\u0131 sa\u011flamak i\u00e7in gereken alternatif NTP sunucular\u0131n\u0131n yap\u0131land\u0131r\u0131lmas\u0131n\u0131 sa\u011flar. [Varsay\u0131lan de\u011fer 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "G\u00f6rsellerinizi optimize edin";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Profil olu\u015fturucunun, e\u015flerin do\u011fru profilini \u00e7\u0131karmak i\u00e7in s\u00fcrekli istemci t\u00fcneli kullan\u0131m\u0131na g\u00fcvendi\u011fini unutmay\u0131n.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "E\u011fer acele ediyorsan\u0131z ve birka\u00e7 saat bekleyemiyorsan\u0131z, insanlara \"jump\" adres yard\u0131mc\u0131 y\u00f6nlendirme hizmetini kullanmalar\u0131n\u0131 s\u00f6yleyebilirsiniz. Bu, genellikle kendi alan ad\u0131n\u0131z\u0131 ayn\u0131 sitede kaydettikten birka\u00e7 dakika sonra \u00e7al\u0131\u015fmaya ba\u015flayacakt\u0131r. Taray\u0131c\u0131n\u0131za <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> adresini girerek \u00f6nce kendiniz test edebilirsiniz. \u00c7al\u0131\u015ft\u0131\u011f\u0131nda, di\u011fer insanlara kullanmalar\u0131n\u0131 s\u00f6yleyebilirsiniz.";
