    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Ba\u015fka y\u00f6nlendiriciler taraf\u0131ndan y\u00f6nlendiriciniz \u00fczerinden in\u015fa edilen t\u00fcneller. Bu, a\u011f talebi, payla\u015f\u0131lan bant geni\u015fli\u011fi ve yerel olarak olu\u015fturulan trafi\u011fe g\u00f6re b\u00fcy\u00fck \u00f6l\u00e7\u00fcde de\u011fi\u015febilir. Kat\u0131lan t\u00fcnelleri s\u0131n\u0131rlaman\u0131n \u00f6nerilen y\u00f6ntemi, <a  href='/config'>Bant Geni\u015fli\u011fi Yap\u0131land\u0131rma sayfas\u0131nda</a> payla\u015f\u0131m y\u00fczdenizi de\u011fi\u015ftirmektir. Ayr\u0131ca, <a href='/configadvanced'>Geli\u015fmi\u015f yap\u0131land\u0131rma sayfas\u0131nda</a> <code>router.maxParticipatingTunnels=nnn</code> olarak toplam say\u0131y\u0131 s\u0131n\u0131rlayabilirsiniz. <a href='/configstats#tunnel.participatingTunnels'>[Grafikleri etkinle\u015ftir]</a>.";
