    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "I2P i\u00e7in alternatif bir web sunucusunu yap\u0131land\u0131rmak i\u00e7in, mevcut web sunucusu t\u00fcnelini kullanabilir ve varsay\u0131lan web sunucusunu devre d\u0131\u015f\u0131 b\u0131rakmak i\u00e7in <a href=/configclients>a\u011f\u0131rl\u0131kl\u0131 olarak</a> kullanabilirsiniz, veya <a href=/i2ptunnelmgr>T\u00fcnel Y\u00f6neticisi</a>'nde yeni bir HTTP Sunucusu t\u00fcneli olu\u015fturun. Web sunucusunun <i>al\u0131\u015f portunun</i> de T\u00fcnel Y\u00f6neticisi ayarlar\u0131nda yap\u0131land\u0131r\u0131ld\u0131\u011f\u0131ndan emin olun. \u00d6rne\u011fin, web sunucusunun varsay\u0131lan olarak 127.0.0.1 adresinde 80 numaral\u0131 portta dinleme yapmas\u0131 durumunda, hizmet i\u00e7in T\u00fcnel Y\u00f6neticisi ayarlar\u0131 sayfas\u0131nda da <i>Hedef portun</i> 80'e yap\u0131land\u0131r\u0131ld\u0131\u011f\u0131ndan emin olman\u0131z gerekecektir.";
