    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Bir I2P y\u00f6nlendiricisinin genellikle yaln\u0131zca bir kez tohumlanmas\u0131 gereklidir, ilk kez a\u011fa kat\u0131lmak i\u00e7in. Ancak, y\u00f6nlendirici a\u011f ba\u011flant\u0131s\u0131 olmadan uzun s\u00fcre \u00e7al\u0131\u015f\u0131yorsa, yeniden tohumlanmas\u0131 gerekebilir. Tohumlama, g\u00fcvenceye al\u0131nm\u0131\u015f bir zip dosyas\u0131na paketlenmi\u015f birden fazla \"RouterInfo\" dosyas\u0131n\u0131 (g\u00f6n\u00fcll\u00fc i\u015fletilen, nette \u00e7al\u0131\u015fan HTTPS sunucular\u0131n\u0131n \u00f6nceden tan\u0131mlanm\u0131\u015f en az iki URL'sinden se\u00e7ilen) indirmeyi i\u00e7erir.";
