    t[10072] = "A guide to reseeding the router";
    t[10073] = "Y\u00f6nlendiriciyi yeniden tohumlama k\u0131lavuzu";
    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Yoksullukla \u00fcnl\u00fc <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>D\u00fcnya \u00d6zg\u00fcrl\u00fck Raporu</a>'ndan t\u00fcretilen \u00fclkelerin listesi. Bu liste, belirtilen \u00fclkelerde \u00e7al\u0131\u015fan y\u00f6nlendiricileri <i>Gizli Mod</i>'a yerle\u015ftirmek i\u00e7in kullan\u0131l\u0131r ve kullan\u0131c\u0131lar i\u00e7in geli\u015ftirilmi\u015f g\u00fcvenlik sa\u011flar. A\u015fa\u011f\u0131daki \u00fclkeler \u015fiddetli olarak belirlenmi\u015ftir: Afganistan, Azerbaycan, Bahreyn, Belarus, Bruney, Burundi, Kamerun, Orta Afrika Cumhuriyeti, \u00c7ad, \u00c7in, K\u00fcba, Demokratik Kongo Cumhuriyeti, M\u0131s\u0131r, Ekvator Ginesi, Eritre, Etiyopya, \u0130ran, Kazakistan, Laos, Libya, Myanmar, Kuzey Kore, Filistin B\u00f6lgeleri, Ruanda, Suudi Arabistan, Somali, G\u00fcney Sudan, Sudan, Esvatini (Svaziland), Suriye, Tacikistan, Tayland, T\u00fcrkiye, T\u00fcrkmenistan, Venezuela, Birle\u015fik Arap Emirlikleri, \u00d6zbekistan, Bat\u0131 Sahra, Yemen.";
