    t[10294] = "A limited selection of stats is enabled by default, required for monitoring router performance. Only stats that have an optional graph are listed here; for a full list of enabled stats, view the <a href=\"/stats\">stats page</a>.";
    t[10295] = "Varsay\u0131lan olarak s\u0131n\u0131rl\u0131 bir se\u00e7im istatistik etkinle\u015ftirilir. Sadece iste\u011fe ba\u011fl\u0131 bir grafik olan istatistikler burada listelenir; etkinle\u015ftirilen istatistiklerin tam listesini g\u00f6rmek i\u00e7in, <a href=/stats>istatistikler sayfas\u0131na</a> bak\u0131n.";
