    t[10312] = "Please wait for routing commitment to expire for {0} tunnel";
    t[10313] = new java.lang.String[] { "L\u00fctfen {0} t\u00fcnel i\u00e7in y\u00f6neltme atamalar\u0131n\u0131n s\u00fcresi dolana kadar bekleyin", "L\u00fctfen {0} t\u00fcnel i\u00e7in y\u00f6neltme atamalar\u0131n\u0131n s\u00fcresi dolana kadar bekleyin" };
    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "M\u00fcmk\u00fcn oldu\u011funda, l\u00fctfen modem/router/pc g\u00fcvenlik duvar\u0131n\u0131z\u0131 yap\u0131land\u0131rarak I2P+/Java'n\u0131n internetten \u00e7ift y\u00f6nl\u00fc port eri\u015fimine izin verildi\u011finden emin olun. S\u0131k\u0131 bir g\u00fcvenlik duvar\u0131n\u0131n arkas\u0131nda olabilir, ancak s\u0131n\u0131rs\u0131z d\u0131\u015fa do\u011fru eri\u015fiminiz varsa, I2P+ hala \u00e7al\u0131\u015fabilir; giri\u015fe giden rotay\u0131 kapatabilir ve <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Adresi Alg\u0131lama</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall deli\u011fi a\u00e7ma</a>) y\u00f6ntemine g\u00fcvenerek a\u011fa ba\u011flanabilirsiniz ve yan paneldeki a\u011f durumu \"Durum: G\u00fcvenlik Duvar\u0131nda\" olarak g\u00f6sterilecektir. Optimal performans i\u00e7in, l\u00fctfen I2P'nin <a href=/confignet#udpconfig>harici portunun</a> internet \u00fczerinden g\u00f6r\u00fclebilir oldu\u011fundan emin olun (daha fazla bilgi i\u00e7in a\u015fa\u011f\u0131ya bak\u0131n).";
