    t[11021] = "Uygulama eki {0} klas\u00f6r\u00fcne kopyalanamad\u0131";
    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Varsay\u0131lan olarak, I2P, ba\u015flang\u0131\u00e7ta ba\u015flatmak i\u00e7in sistem yap\u0131land\u0131r\u0131lm\u0131\u015f varsay\u0131lan taray\u0131c\u0131y\u0131 kullan\u0131r. Ba\u015fka bir taray\u0131c\u0131 aday g\u00f6stermek isterseniz, router.config dosyan\u0131z\u0131 d\u00fczenlemeniz gerekecektir (veya geli\u015fmi\u015f konsol modunu etkinle\u015ftirmi\u015fseniz <a href=/configadvanced>Geli\u015fmi\u015f Yap\u0131land\u0131rma sayfas\u0131</a>) ve kullanmak istedi\u011finiz taray\u0131c\u0131n\u0131n adresini i\u00e7eren yeni bir yap\u0131land\u0131rma sat\u0131r\u0131 eklemelisiniz. <code>routerconsole.browser=/path/to/browser</code> veya <code>routerconsole.browser=\\path\\to\\browser.exe</code> Windows kullan\u0131yorsan\u0131z, <code>\\path\\to\\browser</code> ifadesini kullan\u0131lan taray\u0131c\u0131n\u0131n konumuyla de\u011fi\u015ftirin. Not: Se\u00e7ti\u011finiz taray\u0131c\u0131n\u0131n yolunda bo\u015fluk varsa, yolun al\u0131nt\u0131 i\u015fareti i\u00e7ine alman\u0131z gerekebilir, \u00f6rne\u011fin, <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code> gibi.";
