    t[11093] = "Yeniden iletilen paketler";
    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Bu ayar (saat cinsinden) bir RouterInfo'nun kontrol edilmesi i\u00e7in ne kadar eski olmas\u0131 gerekti\u011fini manuel olarak yap\u0131land\u0131rman\u0131za olanak tan\u0131r. Varsay\u0131lan olarak, bir yenileme ba\u015flamadan \u00f6nceki RouterInfo'nun ya\u015f\u0131n\u0131n b\u00fcy\u00fcyerek NetDb'nin b\u00fcy\u00fckl\u00fc\u011f\u00fcne g\u00f6re \u00f6l\u00e7eklendirilir. 0 de\u011feri, RouterYenileme G\u00f6revinin NetDb'deki her rotay\u0131 ya\u015f\u0131na bak\u0131lmaks\u0131z\u0131n kontrol etmesini sa\u011flar.";
