    t[11124] = "Install from file failed";
    t[11125] = "Dosyadan kurulamad\u0131";
    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "B64 karma\u015falar\u0131n\u0131 insan taraf\u0131ndan okunabilir adlara e\u015fleyen a\u011f i\u00e7in hizmet hedeflerini y\u00f6neten bir I2P web uygulamas\u0131d\u0131r. Hedefler manuel olarak veya hosts.txt dosyalar\u0131na abone olarak eklenir. Ayr\u0131ca SusiDNS olarak da adland\u0131r\u0131l\u0131r. Daha fazla bilgi i\u00e7in <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>\u00e7evrimi\u00e7i belgelere</a> bak\u0131n.";
    t[11130] = "Events per period";
