    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "I2P i\u00e7indeki ana IRC sunucusu a\u011f\u0131na, Irc2P, I2P kuruldu\u011funda (T\u00fcnel Y\u00f6neticisine bak\u0131n: <a href=/i2ptunnelmgr>T\u00fcnel Y\u00f6neticisi</a>), otomatik olarak olu\u015fturulur ve I2P y\u00f6nlendirici ba\u015flad\u0131\u011f\u0131nda otomatik olarak ba\u015flat\u0131l\u0131r. Bununa ba\u011flanmak i\u00e7in IRC istemcinizin sunucuya ba\u011flanmas\u0131n\u0131 s\u00f6yleyin: <code>127.0.0.1</code> port: <code>6668</code>.";
