    t[11280] = "To determine peer latency, this setting allocates the maximum time a peer test should take before being considered a failure, configured in milliseconds. In the event that the timeout is configured lower than the average successful test, the average successful test value will be used. [Default is 1000]";
    t[11281] = "D\u00fc\u011f\u00fcm gecikmesini belirlemek i\u00e7in bu ayar, bir d\u00fc\u011f\u00fcm testinin ba\u015far\u0131s\u0131zl\u0131k olarak kabul edilmeden \u00f6nce alabilece\u011fi maksimum s\u00fcreyi milisaniye cinsinden ay\u0131r\u0131r. Zaman a\u015f\u0131m\u0131n\u0131n ortalama ba\u015far\u0131l\u0131 testten daha d\u00fc\u015f\u00fck yap\u0131land\u0131r\u0131ld\u0131\u011f\u0131 durumda, ortalama ba\u015far\u0131l\u0131 test de\u011feri kullan\u0131l\u0131r. [Varsay\u0131lan 1000]";
