    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "\u00c7oklu istemci hizmetleri i\u00e7in tek bir t\u00fcnel setini kullanabilmek i\u00e7in, istemciler <i>T\u00fcnel Y\u00f6neticisi</i>nden <i>Payla\u015f\u0131lan \u0130stemci</i> modunda \u00e7al\u0131\u015facak \u015fekilde yap\u0131land\u0131r\u0131labilir. Bu mod, kaynaklar\u0131 korur ve \u00e7oklu istemcilerden gelen trafi\u011fi tek bir t\u00fcnel setine kar\u0131\u015ft\u0131r\u0131r, bu da trafik analizini zorla\u015ft\u0131r\u0131r. Payla\u015f\u0131lan \u0130stemci olarak yap\u0131land\u0131r\u0131lan istemciler ayn\u0131 t\u00fcnel se\u00e7eneklerini payla\u015f\u0131rlar.";
