    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Modeminiz veya y\u00f6nlendiriciniz <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Evrensel Tak-\u00e7al\u0131\u015ft\u0131r (UPnP)</a> \u00f6zelli\u011fini destekleyebilir, bu da otomatik port y\u00f6nlendirmesine izin verir. I2P+ i\u00e7in UPnP deste\u011finin <a href=/confignet>yap\u0131land\u0131rma sayfas\u0131nda</a> etkin oldu\u011fundan emin olun, ard\u0131ndan modeminiz/router\u0131n\u0131zda ve muhtemelen bilgisayar\u0131n\u0131zda UPnP'yi etkinle\u015ftirmeyi deneyin. \u015eimdi <a href=/>I2P+ y\u00f6nlendiriciyi</a> yeniden ba\u015flatmay\u0131 deneyin. Ba\u015far\u0131l\u0131 oldu\u011funda, I2P+ y\u00f6nlendirici ilk ba\u011flant\u0131 testlerini tamamlad\u0131\u011f\u0131nda yan panelde \"Durum: TAMAM\" raporlamal\u0131d\u0131r.";
