    t[11983] = "Geli\u015f TCP ba\u011flant\u0131s\u0131 etkinle\u015ftirilmi\u015fken TCP kap\u0131 numaran\u0131z g\u00fcvenlik duvar\u0131 taraf\u0131ndan engelleniyorsa, y\u00f6nelticiler TCP \u00fczerinden ileti\u015fim kuramaz. Bu durum a\u011f\u0131 olumsuz etkiler.";
    t[11984] = "Local Identity";
    t[11985] = "Yerel Kimlik";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "I2P \u00e7o\u011fu g\u00fcvenlik duvar\u0131n\u0131n arkas\u0131ndan iyi \u00e7al\u0131\u015f\u0131r. Bununla birlikte genellikle I2P kap\u0131 numaras\u0131n\u0131 hem UDP hem de TCP olarak a\u00e7arsan\u0131z h\u0131z\u0131n\u0131z ve a\u011f ile b\u00fct\u00fcnle\u015fmeniz daha iyi olur.";
    t[12002] = "Shared Clients";
    t[12003] = "Payla\u015f\u0131lan M\u00fc\u015fteriler";
    t[12006] = "Configuration files for the router, installed plugins, and router logs are stored in the following location:";
    t[12007] = "Y\u00f6nlendirici, y\u00fcklenen eklentiler ve y\u00f6nlendirici g\u00fcnl\u00fckleri i\u00e7in yap\u0131land\u0131rma dosyalar\u0131 a\u015fa\u011f\u0131daki konumda saklan\u0131r:";
    t[12008] = "Postman's POP3 Mail Server (pop3.postman.i2p)";
    t[12009] = "Postac\u0131'n\u0131n POP3 Posta Sunucusu (pop3.postman.i2p)";
    t[12014] = "Plugin update requires installed plugin version {0} or higher";
    t[12015] = "Uygulama ekinin g\u00fcncellenebilmesi i\u00e7in kurulu uygulama eki s\u00fcr\u00fcm\u00fc {0} ya da \u00fczerinde olmal\u0131d\u0131r";
    t[12018] = "Permanently banned";
    t[12019] = "Kal\u0131c\u0131 olarak yasakland\u0131";
    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "3 s\u0131\u00e7ramadan uzun t\u00fcneller (\u00f6rne\u011fin 2 s\u0131\u00e7rama +0-2 s\u0131\u00e7rama, 3 s\u0131\u00e7rama + 0-1 s\u0131\u00e7rama, 3 s\u0131\u00e7rama + 0-2 s\u0131\u00e7rama) ya da y\u00fcksek say\u0131s\u0131 + yedek say\u0131s\u0131 tutarl\u0131l\u0131k ya da ba\u015far\u0131m\u0131 \u00f6nemli oranda d\u00fc\u015f\u00fcr\u00fcr.";
    t[12022] = "Sidebar";
    t[12023] = "Yan \u00c7ubuk";
    t[12024] = "A router that facilitates the connection to the network of another router that is behind a firewall.";
    t[12025] = "Bir g\u00fcvenlik duvar\u0131n\u0131n arkas\u0131nda bulunan ba\u015fka bir y\u00f6nlendiricinin a\u011fa ba\u011flant\u0131s\u0131n\u0131 kolayla\u015ft\u0131ran bir y\u00f6nlendirici.";
    t[12026] = "I2P FAQ";
    t[12027] = "S\u0131k Sorulan I2P Sorular\u0131";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "E\u011fer <i>Y\u00f6nlendirici Bilgileri</i> ba\u015fl\u0131\u011f\u0131n\u0131n \u00fczerine gelirseniz, k\u0131rp\u0131lm\u0131\u015f y\u00f6nlendirici kimli\u011finiz g\u00f6sterilir (44 karakterlik (256 bit) Base64 y\u00f6nlendirici \u00f6zetinin ilk d\u00f6rt karakteri (24 bit)). Tam \u00f6zet, <a href='netdb?r=.'>A\u011f Veritaban\u0131 giri\u015finizde</a> g\u00f6r\u00fcnt\u00fclenir. Kimseye a\u00e7\u0131k etmeyin \u00e7\u00fcnk\u00fc y\u00f6nlendirici kimli\u011finiz a\u011f veritaban\u0131ndaki IP adresinizle benzersiz bir \u015fekilde ili\u015fkilidir.";
    t[12030] = "Previous";
    t[12031] = "\u00d6nceki";
    t[12032] = "Stopped router";
    t[12033] = "Y\u00f6neltici durduruldu";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Dizin listelemeleri (bazen sanal dizinler olarak adland\u0131r\u0131l\u0131r) varsay\u0131lan olarak etkinle\u015ftirilir, bu nedenle dosyalar\u0131n ba\u011flant\u0131lar\u0131n\u0131 i\u00e7eren bir sayfa sa\u011flamadan <code>docroot</code>'un alt dizininden dosyalar\u0131 bar\u0131nd\u0131rabilirsiniz. Ayr\u0131ca, istenen dizine <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>sembolik bir ba\u011flant\u0131</a> kullanarak <code>docroot</code> d\u0131\u015f\u0131nda var olan i\u00e7eri\u011fi sunabilirsiniz.";
    t[12044] = "You have configured I2P to share only {0} KBps.";
    t[12045] = "I2P payla\u015f\u0131m\u0131 {0} KBps h\u0131z\u0131na ayarlanm\u0131\u015f.";
