    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "<i class=example>explicit</i> y\u00f6nergesini kullanarak, bir e\u015fik tan\u0131m\u0131nda kendisiyle birlikte listelenen bir uzak hedefe \u00f6zel e\u015fikler belirtme se\u00e7ene\u011fiyle uygulanabilir. Uzak hedefler, <i class=example>allow</i> anahtar kelimesini kullanarak varsay\u0131lan e\u015fikten hari\u00e7 tutulabilir veya <i class=example>deny</i> anahtar kelimesini kullanarak kal\u0131c\u0131 olarak engellenebilir:";
