    t[12183] = "Sebep";
    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "Bu ayar, Peer Exploration Job \u00e7al\u0131\u015ft\u0131r\u0131ld\u0131\u011f\u0131nda ka\u00e7 tane NetDb DHT kovas\u0131n\u0131 referans alaca\u011f\u0131n\u0131 belirler. Varsay\u0131lan olarak ke\u015ffedilecek kova say\u0131s\u0131, rot\u00f6r\u00fcn bir saat veya daha fazla s\u00fcredir \u00e7al\u0131\u015f\u0131p \u00e7al\u0131\u015fmad\u0131\u011f\u0131na, rot\u00f6r\u00fcn gizli veya 'K' bant geni\u015fli\u011fi seviyesinde olup olmad\u0131\u011f\u0131na ve bilinen rot\u00f6r say\u0131s\u0131na ba\u011fl\u0131 olarak de\u011fi\u015fir.";
    t[12186] = "threat points";
    t[12187] = "tehdit noktalar\u0131";
    t[12194] = "Failed to stop systray";
    t[12195] = "Sistem tepsisi durdurulamad\u0131";
