    t[12197] = "G\u00fcncelleme ba\u015far\u0131s\u0131z oldu";
    t[12198] = "Hostname Registration";
    t[12199] = "Ana Bilgisayar Ad\u0131 Kayd\u0131";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Bilinen e\u015flerin say\u0131s\u0131 50'nin alt\u0131na d\u00fc\u015ft\u00fc\u011f\u00fcnde, I2P otomatik olarak yeniden tohumlama denemesi yapar. E\u011fer tohumlama denemesi ba\u015far\u0131s\u0131z olursa, yan \u00e7ubukta manuel olarak tohumlama yapma se\u00e7ene\u011fiyle bir bildirim g\u00f6r\u00fcnecektir. Bir tohumlama denemesi ba\u015far\u0131s\u0131z olabilir \u00e7\u00fcnk\u00fc yerel g\u00fcvenlik duvar\u0131n\u0131z \u00e7\u0131k\u0131\u015f trafi\u011fini s\u0131n\u0131rl\u0131yor, a\u011f ba\u011flant\u0131 sorunlar\u0131 ya\u015f\u0131yorsunuz veya tohumlama iste\u011fi tamamen engelleniyorsa.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Reddit i\u00e7in alternatif gizlilik odakl\u0131 \u00f6n u\u00e7";
    t[12224] = "Toggle Tunnels";
    t[12225] = "T\u00fcnelleri De\u011fi\u015ftir";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "<code>clients.config</code> dosyas\u0131nda devre d\u0131\u015f\u0131 b\u0131rak\u0131labilir. Ayr\u0131ca, <code>jetty.xml</code> dosyas\u0131nda belirli bir aray\u00fcze veya t\u00fcm aray\u00fczlere ba\u011flanacak \u015fekilde yap\u0131land\u0131r\u0131labilir.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "Y\u00f6nlendirici ba\u015flad\u0131\u011f\u0131nda hangi hizmetlerin otomatik olarak ba\u015flayaca\u011f\u0131n\u0131 belirleyebilir, y\u00fcksek kullan\u0131ml\u0131 hizmetler i\u00e7in t\u00fcnel tahsisini y\u00f6netebilir veya cpu ve bellek \u00fczerindeki y\u00fck\u00fc en aza indirmek i\u00e7in sunucu ve istemci t\u00fcnelleri ekleyebilir veya a\u011fdaki hizmetlere eri\u015febilirsiniz veya a\u011fdaki hizmetlere eri\u015fmek i\u00e7in sunucu t\u00fcnellerine h\u0131z s\u0131n\u0131rlamas\u0131 veya t\u00fcnel filtreleme ayarlayabilirsiniz ve daha fazlas\u0131.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "LAN adresine ba\u011flan\u0131r. Geli\u015fmi\u015f yap\u0131land\u0131rma ile de\u011fi\u015ftirilebilir <code>i2np.upnp.HTTPPort=nnnn</code>. <a href=/confignet>A\u011f Yap\u0131land\u0131rma sayfas\u0131nda</a> devre d\u0131\u015f\u0131 b\u0131rak\u0131labilir.";
    t[12234] = "Data transferred";
    t[12235] = "Veri aktar\u0131ld\u0131";
    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "<i>Proxy yok</i> i\u015faretli kutuya <code>127.0.0.1,localhost</code> sat\u0131r\u0131n\u0131 ekleyerek I2P konsolu ve di\u011fer yerel bar\u0131nd\u0131r\u0131lan web sitelerinin h\u00e2l\u00e2 mevcut oldu\u011fundan emin olun.";
